            'domisili_rw' => NULL,
            'domisili_file' => NULL,
            'instagram' => NULL,
            'facebook' => NULL,
            'twitter' => NULL,
            'alasan' => 'Latsar Cempor Dispora Kota Bandung merupakan sebuah wadah bagi para pemuda yang ingin mendalami keterampilan untuk membangun atau mengembangkan usahanya. Angka pengangguran di Indonesia yang cukup tinggi, terlebih karena efek pandemi, dan sempitnya lapangan pekerjaan adalah sedikit bagian dari faktor-faktor banyak orang tidak memiliki pekerjaan. Saya sebagai salah seorang pemuda, ingin mengembangkan ilmu dan keterampilan saya untuk membangun usaha di bidang pastry atau bakery karena saya memiliki ketertarikan di bidang tersebut. Maka dari itu, setelah saya melihat kesempatan ini, saya berniat mendaftarkan diri untuk  mengikuti Latsar ini. Saya percaya bahwa panitia Latsar Cempor Dispora Kota Bandung akan memberikan kesempatan seluas-luasnya bagi para pemuda Bandung yang memiliki mimpi dalam membangun usahanya masing-masing.',
            'usaha' => 'Belum',
            'kendalau_saha' => NULL,
            'sekilas_usaha' => NULL,
            'produk' => NULL,
            'pelatihan_dispora_sebelumnya' => 'Tidak',
            'pelatihan_lainnya' => 'Tidak',
            'komunitas' => NULL,
            'ig_komunitas' => NULL,
            'profil_komunitas' => NULL,
        'tentang_diri' => 'Saya adalah seorang mahasiswa Fakultas Hukum yang sedang berada pada tingkat 3 (Semester 6) dengan banyak minat, salah satunya di luar bidang hukum, seperti bidang kuliner. Saya adalah pribadi yang gemar untuk belajar. Sehingga ketika saya minat mengenai suatu hal, saya akan mempelajari hal tersebut. Di bidang kuliner, saya mempelajari sedikit keterampilan baking melalui youtube dan resep yang saya dapatkan melalui sosial media lainnya seperti tiktok maupun instagram.',
            'plus_minus_diri' => 'Karena saya merupakan seseorang yang gemar mempelajari sesuatu, maka saya mudah untuk mempelajari hal baru. Hal tersebut menjadi kelebihan bagi diri saya karena sangat membantu dalam kehidupan sehari-hari.
Namun, saya memiliki kekurangan, yaitu saya mudah kehilangan fokus di tempat ramai. Sehingga, ketika situasi sedang tidak terkendali, saya butuh mengambil waktu untuk menenangkan diri sehingga mampu untuk kembali fokus.',
            'prestasi_diri' => 'Saya pernah tergabung di dalam sebuah tim pada lomba Peradilan Semu Internasional di bidang Hukum Humaniter. Bidang tersebut merupakan hal baru bagi saya, tetapi saya mampu mempelajarinya dan turut berkontribusi dalam kemenangan tim tersebut. Pada saat itu kami menempati peringkat ketiga setelah UGM dan Universitas Tarumanegara setelah mengalahkan 18 tim dari universitas ternama di Indonesia.',
            'kegagalan' => 'Saya pernah mengalami krisis identitas pada saat ingin menimba ilmu di bangku perkuliahan. Pada saat SMA saya adalah siswi yang mengikuti berbagai macam perlombaan, sehingga perkembangan diri saya meluas di beberapa bidang seperti hukum, bahasa, komunikasi, dan geosains. Namun, pada saat akan menginjak bangku perkuliahan, saya memiliki keraguan yang besar akan pilihan jurusan yang sesuai dengan diri saya. Sehingga, saya pernah salah memilih jurusan di universitas swasta. Hal tersebut membuat saya menyesal dan meyakinkan diri saya untuk memilih hal yang saya minati. Pada akhirnya saya memilih jurusan ilmu hukum yang sesuai dengan minat saya.',
            'impian' => 'Saya memiliki impian untuk menjadi legal consultant dan membangun bisnis di saat yang bersamaan. Hal tersebut didasari atas minat saya di bidang hukum dan bidang kuliner.',
            'wawasan_latsar' => 'Pelatihan ini terdiri dari 2 tahap, yaitu tahap pelatihan dasar dan inkubasi. Jika para peserta terbaik mampu lolos dari tes pelatihan dasar tersebut, maka mereka bisa mengikuti tahap inkubasi untuk dibimbing lebih lanjut dalam pembangunan/pengembangan bisnisnya oleh para ahli yang ditunjuk panitia Latsar Cempora. Menurut pengetahuan saya, dari pelatihan dasar tersebut, para peserta akan dibekali ilmu-ilmu dasar mengenai bidang yang dipilih dan risiko yang dapat terjadi dalam produksi di dalam bidang tersebut.',
            'komitmen' => 'Bersedia',
            'anak_ke_berapa' => '4',
            'anak_ke_berapa_dari' => '4',
            'harapan' => 'Saya harap keterampilan dan pengetahuan saya di bidang enterpreunership ini bertambah. Selain itu saya berharap untuk memperluas relasi, untuk mengenal berbagai macam karakter orang dan mengetahui cerita masing-masing orang yang sedang berjuang untuk membangun usahanya.',
