'prestasi_diri' => 'Saya menyukai dunia kepenulisan, di samping dunia usaha dan sebagainya. Dan hal yang paling membuat saya senang dan bangga ialah keberhasilan saya dalam segala kegiatan yang saya lakukan dalam dunia kepenulisan, khususnya ketika artikel ilmiah saya terbit dalam jurnal terakreditasi, mauapun kejuaraan yang saya raih dalam penulisan karya sastra (prosa).',
'kegagalan' => 'Kegagalan yang membuat saya menyesal ialah ketika saya tidak mendapatkan apa yang saya harapkan, oleh karena saya kurang maksimal dalam mengupayakannya. Seperti ketika saya dinyakatan tidak lulus dalam seleksi mandiri UI, saya merasa gagal dan menganggap bahwa usaha yang saya lakukan kurang maksimal.',
