'wawasan_latsar' => 'Pelatihan yang akan saya ikuti merupakan suatu upaya pemerintah Kota Bandung untuk meningkatkan dan memberdayakan kemampuan masyarakat. Pada bidang yang saya ikuti, kiranya ini merupakan suatu pelatihan yang berhubungan dengan kegiatan exsport/ pengiriman barang ke luar negeri, terlebih dalam masalah bisnis.',
