'pengertian_pengusaha' => 'Menurut saya, pengusaha ialah seorang yang pekerja keras, tekun dan adaptif, serta mampu mengambil dan memanfaatkan setiap peluang yang ia temui. Seorang pengusaha juga merupakan jiwa yang inovatif, mampu bersaing dan tahu akan tujuan (goal) yang hendak ia capai.',
'satusatunya' => 'Saya tidak membatasi diri; selalu terbuka dan senantiasa mencoba berbagai hal. Saya pikir menjadi pengusaha ialah impian semua orang, dan semua orang mampu menjadi pengusaha selama ia tekun dan pantang menyerah. Saya cocok menjadi pengusaha.',
