Berawal dari berjualan di teras rumah dengan peralatan seadanya kami yakin dan berusaha untuk menjual produk kami. WAFFLE & CROFFLE BCI ini terinprasi oleh makanan atau cemilan khas belgia yang sangat populer, di daerah kami masih jarang yang berjualan kaki lima atau dengan harga yang terjangkau untuk kelas menengah kebawah. Dari situlah kami tergugah untuk menjalankan usaha ini. Berjalan 1 bulan Alhamdulillah omset kami naik karena produk kami ini unik yaitu dengan banyaknya pilihan cream dan topping yang dapat dipilih oleh pelanggan sesuai keinginan mereka, jadi tidak membosankan. Namun dalam satu tahun toko atau usaha kami terpaksa tutup karena kami harus pindah tempat tinggal. 

