'instagram' => NULL,
'facebook' => NULL,
'twitter' => NULL,
'alasan' => 'Karena Latsar Cempor (Camp Entrepreneur Dispora Kota Bandung) ini merupakan program unggulan dari Dinas Pemuda dan Olahraga Kota Bandung, yang memiliki metode pelatihan bersifat berkelanjutan, dimulai dari pelatihan dasar â manajerial skill, inkubasi (pendampingan serta asistensi), hingga expo dan promosi yang sangat berguna untuk generasi Z. Selain itu Latsar Cempor Dispora Kota Bandung ini memfokuskan kepada pelatihan secara basic atau dasar dengan tujuan untuk melatih para peserta yang mengikutinya dan memberikan pemahaman serta mengenali dasar-dasar tingkat kerumitan hingga resiko dari bebagai sisi produksi yang diminati seseorang.',
'usaha' => 'Belum',
'kendalau_saha' => NULL,
'sekilas_usaha' => NULL,
'produk' => NULL,
