'pelatihan_lainnya' => 'Pelatihan Administrasi Perkantoran, Disnaker Kota Bandung. Tahun 2020',
'komunitas' => NULL,
'ig_komunitas' => NULL,
'profil_komunitas' => NULL,
'tentang_diri' => 'Perkenalkan, saya Nurramayuningsih, lulusan dari Universitas Pasundan mengambil jurusan Manajemen Keuangan. Sewaktu saya lulus saya sempat bekerja selama 4 bulan di Event Organizer bagian staf keuangan dan saat ini saya sedang bekerja di perusahaan swasta sebagai staf piutang sudah berjalan 8 bulan.

Di kampus, saya juga pernah menjadi staf SDM di Himpunan Mahasiswa Manajemen selama 1 tahun masa jabatan. Saya sangat mencintai pengalaman kerja dan berorganisasi saya karena bisa mempraktekkan ilmu yang saya peroleh selama kuliah.

Harapannya, dengan pengalaman tersebut, meski singkat, saya harus tetap belajar dan belajar memberikan kontribusi dalam mengikuti pelatihan exprortir ini.',
'plus_minus_diri' => 'Kekurangan :
1. Kurang percaya diri.
2. Memiliki pengalaman kerja yang minim.
3. Terlalu ambisius.
4. Kurang menguasai bahasa asing.
5. Mudah kecewa dengan diri sendiri.
6. Sedikit ceroboh dan lupa.
Kelebihan
1. Selalu membawa catatan kecil dimanapun.
2. Mudah di ajak kerja sama dalam tim.
3. Mau belajar dan selalu ingin mempelajari hal-hal yang baru.
4. Berkomitmen dengan pekerjaan.
5. Bertanggung jawab atas pekerjaan yang diberikan.
6. Loyalitas terhadap suatu pekerjaan.',
'prestasi_diri' => '1. Mendapatkan kesempatan saat masih kuliah belajar dengan dosen yang mengajar di luar negeri (Korea) .
2. Lulus dalam mengikuti pelatihan yang di selenggarakan oleh Disnaker Kota Bandung.
2. Lulus pelatihan prakerja.',
'kegagalan' => 'Tidak lulus dalam mengikuti seleksi BUMN dan CPNS sehingga saya harus tetap belajar dan berusaha agar suatu saat saya bisa lulus seleksi BUMN dan CPNS.',
'impian' => 'Impian saya 5 tahun ke depan menjadi seorang handal di bidang keuangan.
