'alasan' => 'Saya ingin mengikuti Latsar Cempor Dispora ini karena saya ingin mencoba belajar animasi. Saya memiliki kemampuan basic dari animasi, yaitu menggambar. Jadi menurut saya tidak ada salahnya mencoba hal baru selama yang dipelajari masih dalam kapasitas kemampuan saya.',
