'profil_komunitas' => NULL,
'tentang_diri' => 'Nama Saya adalah Puteri Rachmawati, namun lebih akrab dipanggil Chim atau Cece. Saya berusia 22 tahun. Saya tinggal di Kota Bandung, lebih tepatnya di Jalan Ksatriaan. Saya adalah fresh graduate jurusan seni rupa murni dari ISBI Bandung. Saya mendapatkan gelar S1 Sarjana Seni pada Desember tahun 2022.',
'plus_minus_diri' => 'Kelebihan saya antara lain adalah kreatif dalam bidang seni dan serupanya, mahir menggambar secara digital maupun tradisional, dapat memahami materi cukup cepat. 

Kekurangan saya adalah terkadang saya tiba-tiba mengalami art block sehingga pekerjaan saya terganggu dan memakan waktu lebih lama untuk selesai.',
'prestasi_diri' => 'Prestasi saya yang paling membanggakan adalah ketika saya mengikuti FLS2N saat saya masih menginjak bangku SMA, tepatnya pada tahun 2017. Saya menjadi juara 1 di kategori Kriya Putri di FLS2N tingkat Kota Bandung dan Provinsi Jawa Barat. Saya pun menjadi peserta FLS2N tingkat nasional di Kota Kupang, NTT, mewakili nama Kota Bandung dan Provinsi Jawa Barat.',
'kegagalan' => 'Banyak kegagalan yang saya alami, entah dalam berkompetisi atau lainnya, tapi ada beberapa kegagalan yang paling membuat saya sangat menyesal. 

Yang pertama adalah ketika saya tidak berhasil menjadi juara di FLS2N tingkat nasional tahun 2017. Saya gagal membawa piala dan merasa menyesal karena merasa kurang memberikan yang terbaik untuk Kota Bandung dan Provinsi Jawa Barat. 

Kegagalan lainnya adalah ketika saya gagal menjadi peserta W-TOON Camp yang diadakan oleh Kisai Entertainment. Saya gagal karena alat yang saya gunakan untuk mengikuti test kurang memadai. Hal itu berimbas pada hasil test saya, sehingga hasil test saya untuk mengikuti camp itu sangat kurang memuaskan dan berakhir gagal.',
'impian' => 'Impian saya 5 tahun mendatang adalah saya bisa memiliki pekerjaan tetap dengan gaji yang memuaskan dan sesuai dengan bidang dan skill yang saya minati. Saya berharap di 5 tahun yang akan datang atau secepatnya, saya sudah memiliki banyak pengalaman, relasi, dan skill tentang seni maupun lainnya. Saya ingin membuktikan pada diri saya sendiri maupun orang lain, bahwa pekerjaan dalam lingkup bidang seni bukanlah hal yang harus dipandang sebelah mata.',
'wawasan_latsar' => 'Pelatihan yang akan saya ikuti adalah pelatihan animasi. Tentunya saya akan belajar bagaimana proses animasi itu dibuat dan bagaimana cara membuat animasi itu sendiri.',
'komitmen' => 'Bersedia',
