'anak_ke_berapa_dari' => '1',
'harapan' => 'Saya bisa memiliki skill baru tentang cara membuat animasi dan saya memiliki teman/relasi yang lebih banyak dari sebelumnya.',
'pengertian_pengusaha' => 'Menurut saya, pengusaha merupakan seseorang yang bisa mengeksplor kemampuannya untuk menjadi manfaat bagi dia pribadi khususnya, dan bagi orang lain umumnya.',
'satusatunya' => 'Sejujurnya, saya merasa bisa menjadi pengusaha maupun pekerja. Tapi jika disuruh memilih, saya mungkin lebih memilih menjadi pengusaha (ketika saya sudah siap dalam mental maupun kesiapan hal lainnya).',
'cocok_pengusaha' => 'Saya percaya diri dengan kemampuan diri saya dalam mencari ide. Entah dalam ruang lingkup seni maupun bukan, saya percaya saya bisa membuat sebuah usaha dengan ide unik dan menarik. Selain itu, beruntungnya, ibu saya pun seseorang yang selalu bersemangat dalam membuat usaha. Jadi saya bisa bekerjasama dengan beliau jika suatu saat nanti saya akan membuat usaha.',
'jika_tidak_jadi_pengusaha' => 'Ada beberapa profesi yang mungkin saya jalankan. 

Pertama, penulis novel. Saya sudah menerbitkan 2 novel dan saya pun menulis beberapa cerita fanfiction di Wattpad. 

Kedua, illustrator. Saya mungkin akan menjalankan profesi sebagai illustrator (seperti ilustrator untuk buku, ilustrator sampul buku/novel, dll). 

Dan ketiga, colorist webtoon. Colorist webtoon adalah profesi seseorang yang memberikan warna/mewarnai komik webtoon.',
