'twitter' => NULL,
'alasan' => 'Saya memiliki beberapa alasan mengapa tertarik untuk mengikuti Latsar Cempor yang diadakan oleh Dispora Kota Bandung ini, selain ingin menambah pengalaman di luar konteks passion saya sebagai seorang atlet, saya juga memiliki keinginan untuk bisa membuat suatu animasi walaupun masih pemula, yang nantinya diharapkan dapat saya terapkan dalam bidang keguruan saya untuk membuat metode pembelajaran yang kekinian untuk murid-murid saya. Maka dari itu, saya sangat tertarik mengikuti Latsar ini.',
'usaha' => 'Belum',
'kendalau_saha' => NULL,
'sekilas_usaha' => NULL,
'produk' => NULL,
'pelatihan_dispora_sebelumnya' => 'belum pernah',
'pelatihan_lainnya' => 'Pelatihan Kurator yang diadakan oleh Museum Pendidikan Nasional UPI Bandung, In House Training âImplementasi Kurikulum Merdekaâ oleh SMPN 39 Bandung',
'komunitas' => 'thxsociety',
'ig_komunitas' => '@thxsociety',
'profil_komunitas' => 'THXSOCIETY merupakan suatu komunitas anak muda yang mewadahi para anak muda di Kota Bandung dalam begerak di bidang sosial kemasyarakatan. Komunitas ini terbilang masih cukup muda namun di dalamnya sudah mencapai hampir +50 anggota. Adapun jenis kegiatannya seperti bagi takjil gratis (sudah dilaksanakan di bulan Ramadhan), bakti sosial, dan santunan ke Panti Asuhan.',
'tentang_diri' => 'Perkenalkan, nama saya Tira Cantika, biasa dipanggil Tira atau Tita. Saya seorang mahasiswi tingkat akhir pada Program Studi Pendidikan Pancasila dan Kewarganegaraan di UPI Bandung. Saya merupakan seorang warga asli dari Kota Bandung Provinsi Jawa Barat, sembari menjalani kuliah di bidang pendidikan, saya juga aktif berkecimpung di dunia keatletan sejak tahun 2010. Selama hampir 10 tahun menjadi seorang atlet angkat besi mewakili daerah Kota Bandung, saya pernah menjuarai beberapa kejuaraan seperti Piala Gubernur Jabar tahun 2014 (medali emas), Pekan Olahraga Pelajar Daerah (POPDA) Jabar di Tahun 2014, 2016, dan 2018 (medali perak dan perunggu), dan Pekan Olahraga Daerah (PORDA) tahun 2014. Namun, saat ini saya sedang bergelut menjadi seorang atlet dayung dan baru selesai mengikuti PORPROV Jabar tahun 2022 kemarin. Di sisi lain, saya juga tergabung dalam organisasi penggiat alam tingkat jurusan yaitu Mahasiswa Pecinta Alam Civics Hukum (MAPACH) UPI sejak tahun 2019.',
'plus_minus_diri' => 'Saya menyadari beberapa kekurangan yang dimiliki oleh diri saya, seperti terlalu pemikir dan perasa ketika mendapatkan sedikit under-pressure dari lingkungan kerja sehingga membuat lebih sering overthinking dan terkesan menunda-nunda pekerjaan. Namun dari hal tersebut, membuat saya belajar dan introspeksi diri untuk dapat melawan pikiran2 yang tidak seharusnya dipikirkan dan termotivasi untuk bekerja secara gesit serta keluar dari zona nyaman walaupun pekerjaan tsb bukan passion saya.',
'prestasi_diri' => 'Sebagai seorang atlet angkat besi, Saya pernah menjuarai Kejuaraan Piala Gubernur pada tahun 2014 dan menorehkan medali emas untuk Kota Bandung. Selain itu, saya juga dipercaya untuk mengikuti Pekan Olahraga Pelajar Daerah (POPDA) Jabar sebanyak 3x berturut-turut pada tahun 2014, 2016, dan 2018 mewakili daerah saya Kota Bandung. Ketika saya bersekolah di SMPN 2 Bandung dulu, saya juga pernah dinobatkan mjd Siswa Berprestasi Non-Akademik.',
'kegagalan' => 'Mungkin ini bukanlah suatu kegagalan bagi saya, melainkan suatu bentuk konsekuensi dari profesi atau pilihan yang saya ambil sebagai seorang atlet. Kejadian tsb pada th 2016 ketika saya divonis oleh Dokter menderita Cedera ACL (ligamen lutut) dan mengharuskan saya dioperasi. Tentu bukanlah hal yang mudah, sebab cedera ini merupakan cedera yg fatal dan ditakuti oleh para alet. Setelah hampir 10 tahun saya menggeluti dunia keatletan, sehingga olahraga dirasa sudah mendarahdaging dalam diri saya, dari sejak itulah, saya memutuskan utk berhenti mjd seorang atlet angkat besi, karena dokter sudah sangat tidak menyarankan saya untuk berolahraga berat.',
'impian' => 'Saya memiliki beberapa cita dan impian di 5 tahun mendatang, mendapatkan gelar Magister di kebidangan saya yakni PPKn dan menjadi seorang guru yang aktif, kreatif, dan adaptif dengan zaman. Bukan sekadar mjd seorang guru yang mengajar muridnya di kelas saja, namun turut berpartisipasi mengikuti kegiatan di luar juga bawik itu yg linier maupun tidak. Selain itu, saya juga ingin tetap konsisten dgn passion saya sebagai org yg hobby olahraga, walaupun sdh tdk berkecimpung membela nama daerah. Terakhir, tentunya saya ingin menjadi seorang manusia yang bisa memahami diri sendiri dengan baik dan bermanfaat utk org banyak. Karena sejatinya, manusia lahir âpada kemanusiaanâ.',
'wawasan_latsar' => 'Sebagaimana kita ketahui bahwa animasi merupakan salah satu media yang sudah populer ditemukan dalam kehidupan sehari-hari. Bukan hanya terkenal dalam hal hiburan, namun lebih dari itu animasi juga dapat dimanfaatkan dlm segala hal seperti media informasi, politik, pelestarian budaya, media pendidikan, dan dunia bisnis. Namun tentunya dalam bidang animasi ini masih memiliki banyak kecabangan yang masih perlu saya pelajari scr mendalam.',
'komitmen' => 'Bersedia',
'anak_ke_berapa' => '2',
'anak_ke_berapa_dari' => '2',
'harapan' => 'Saya dapat menambah kemampuan baru saya khususnya dalam pembuatan animasi. Sehingga ketika kelak saya sudah berhasil menjadi seorang guru, ilmu animasi ini bisa saya gunakan untuk membuat suatu media pembelajaran yang asyik dan komunikatif serta kekinian untuk murid saya.',
'pengertian_pengusaha' => 'Pengusaha merupakan seseorang yang memiliki jiwa wirausahawan tinggi, berani bertindak, loyal dan tanggungjawab. Seorang pengusaha mampu mengembangkan bakatnya dalam hal usaha dan selalu terpacu membuat suatu terobosan baru untuk disebarluaskan atau diproduksi.',
'satusatunya' => 'Mungkin pengusaha bukan profesi utama yang akan saya geluti. Namun di sisi lain saya sbg seorang guru, saya berharap bahwa berwirausaha dapat menjadi kegiatan sampingan saya sbg bentuk aktualisasi diri',
'cocok_pengusaha' => 'Jiwa loyal dan pantang menyerah ketika berada di tengah kesulitan dan menjalani suatu tanggungjawab',
