'instagram' => NULL,
'facebook' => NULL,
'twitter' => NULL,
'alasan' => 'Alasan saya mengikuti pelatihan animasi Latsar Cempor Dispora Kota Bandung akan meningkatkan kemampuan dan pengetahuan saya dalam bidang animasi. Ini dapat meningkatkan kesempatan saya untuk mendapatkan pekerjaan atau proyek di industri animasi, yang mana saat ini sedang berkembang pesat di Indonesia.',
'usaha' => 'Belum',
'kendalau_saha' => NULL,
'sekilas_usaha' => NULL,
'produk' => NULL,
'pelatihan_dispora_sebelumnya' => 'Belum pernah',
'pelatihan_lainnya' => 'Digitalent kominfo intermediete animator 2019, BPPTIK Desain grafis 2019',
'komunitas' => 'Ilustrasee',
'ig_komunitas' => '@ilustra.see',
'profil_komunitas' => 'Meetup gambar bareng, sharing seputar ilustrasi dan projek',
'tentang_diri' => 'Saya Dinda Jihan, usia saya 23 tahun. Saya memiliki hobi yang sangat saya sukai yaitu menggambar, terutama dalam bentuk ilustrasi dan desain grafis. Saat ini, saya bekerja sebagai freelance desainer grafis dan ilustrator, Saya telah bekerja di bidang ini selama beberapa tahun dan sangat menikmati pekerjaan saya karena saya dapat mengekspresikan kreativitas dan imajinasi saya melalui karya saya.

Meski saya telah memperoleh banyak pengalaman dalam desain grafis dan ilustrasi, saya tidak pernah berhenti untuk belajar hal baru. Belakangan ini, saya merasa tertarik untuk mempelajari animasi. Saya merasa bahwa animasi memberikan cara baru untuk mengekspresikan diri dalam karya saya, dan saya ingin belajar lebih banyak tentang teknik dan proses animasi.

Oleh karena itu, saya telah mencari peluang untuk mengikuti pelatihan animasi dan memperdalam pengetahuan saya dalam hal ini. Saya percaya bahwa dengan mempelajari animasi, saya dapat menghasilkan karya yang lebih kompleks dan menarik, dan memberikan nilai tambah untuk klien saya.

Saya sangat antusias untuk mengeksplorasi dunia animasi dan mempelajari semua hal baru yang bisa saya dapatkan. Dengan kombinasi pengalaman dan minat belajar saya dalam animasi, saya yakin dapat memberikan kontribusi yang lebih baik untuk industri kreatif di masa depan.',
'plus_minus_diri' => 'Saya mengakui bahwa saya memiliki kekurangan sebagai seorang pelupa dan kurang percaya diri tampil di depan kamera. Meski begitu, saya berusaha untuk terus meningkatkan kemampuan saya dalam hal ini dengan berlatih dan mencari bantuan dari orang-orang terdekat.

Sementara itu, kelebihan saya adalah kreatif, ambisius, dan mempunyai skill menggambar yang cukup baik. Saya senang menghasilkan karya-karya yang unik dan memiliki nilai estetika tinggi. Saya juga memiliki ambisi yang besar dalam hal mencapai kesuksesan di bidang desain grafis dan ilustrasi.

Saya yakin bahwa dengan menjaga semangat kreatif dan kerja keras, saya dapat mengatasi kekurangan saya dan memaksimalkan kelebihan saya untuk mencapai tujuan saya di bidang desain grafis dan ilustrasi. Saya percaya bahwa ketekunan dan kemauan untuk belajar dapat membantu saya untuk berkembang dan sukses di masa depan.',
'prestasi_diri' => 'Saya sangat bangga dengan prestasi-prestasi yang telah saya raih. Salah satu prestasi terbesar saya adalah menjadi 15 siswa terbaik saat SMK dan berhasil mendapatkan beasiswa full untuk melanjutkan kuliah. Prestasi ini membuktikan bahwa saya memiliki kemampuan akademik yang baik dan kerja keras saya terbayar dengan hasil yang memuaskan.

Selain itu, saya juga meraih berbagai juara dalam tingkat nasional dalam perlombaan poster. Karya-karya saya telah diakui oleh banyak orang dan dipamerkan di berbagai pameran. Prestasi ini membuat saya merasa semakin termotivasi untuk terus mengembangkan kemampuan saya dalam dunia desain grafis dan ilustrasi.

Saya percaya bahwa prestasi-prestasi ini menjadi bukti bahwa kerja keras dan tekad yang kuat dapat membawa kesuksesan di masa depan. Saya berharap dapat terus mengembangkan kemampuan saya dan memperoleh prestasi-prestasi yang lebih besar di masa depan.',
'kegagalan' => 'saya merasa sangat gagaldalam membiayai perkuliahan saya hingga beberapa bulan menunggak. Saya menyadari bahwa tanggung jawab tersebut seharusnya menjadi prioritas utama saya, dan saya bertanggung jawab atas kegagalan ini.

Selain itu, saya juga merasa sangat menyesal karena belum bisa membiayai orang tua untuk keperluan sehari-hari setelah saya memutuskan untuk resign dari pekerjaan saya. Saya menyadari kurang persiapan dalam perancanaan keuangan hingga difase titik terendah.

Meskipun saya merasa sangat menyesal atas kegagalan ini, saya belajar bahwa kegagalan adalah bagian dari perjalanan hidup dan saya harus mengambil pelajaran darinya. Saya berusaha untuk belajar dari kesalahan saya dan bertekad untuk tidak mengulanginya lagi di masa depan.

Saya percaya bahwa dengan tekad yang kuat dan kerja keras, saya dapat mencapai tujuan saya dan memberikan yang terbaik bagi orang-orang terdekat saya. Saya berharap dapat memperbaiki kesalahan saya dan menghasilkan prestasi yang lebih baik di masa depan.',
'impian' => 'Impian saya 5 tahun kedepan adalah sukses di bidang ilustrasi dan animasi. Saya ingin menjadi seorang ilustrator dan animator yang terkenal, dengan karya-karya yang tidak hanya memukau mata, tetapi juga memiliki dampak positif bagi masyarakat.

Saya ingin menciptakan karya-karya yang dapat menginspirasi orang lain, mengangkat isu-isu sosial yang penting, dan menyampaikan pesan-pesan positif yang dapat memotivasi dan mengubah pandangan hidup banyak orang.

Saya berharap dapat terus mengembangkan kemampuan saya dalam bidang ilustrasi dan animasi, serta memperluas jaringan kerja dan kesempatan untuk mengeksplorasi bakat saya. Saya ingin menjadi pelopor dalam industri kreatif, dan membuka pintu bagi orang-orang muda yang memiliki minat dan potensi dalam bidang yang sama.

Saya percaya bahwa impian saya dapat terwujud dengan kerja keras, tekad yang kuat, dan semangat untuk terus belajar dan berkembang. Saya berkomitmen untuk mengambil tindakan nyata untuk mewujudkan impian saya, dan berharap dapat mencapai tujuan saya dalam waktu lima tahun mendatang.',
'wawasan_latsar' => 'Cempor (Camp Entrepreneur Dispora Kota Bandung) adalah program unggulan dari Dinas Pemuda dan Olahraga Kota Bandung, program animasi yang memberikan berbagai fasilitas untuk',
'komitmen' => 'Bersedia',
'anak_ke_berapa' => '2',
'anak_ke_berapa_dari' => '2',
'harapan' => 'Setelah mengikuti pelatihan dasar CEMPOR 2023, harapan saya adalah dapat meningkatkan kemampuan dan pengetahuan saya dalam bidang animasi, serta memperoleh pengalaman berharga dari para ahli dan praktisi terbaik di industri animasi.

Saya berharap dapat memperoleh pemahaman yang lebih mendalam tentang teknik-teknik animasi, mulai dari konsep dasar hingga teknologi terkini. Saya juga berharap dapat memperluas jaringan dan hubungan kerja dengan para profesional di bidang animasi, yang dapat membantu saya dalam memasuki industri ini dengan percaya diri.

Selain itu, saya berharap pelatihan ini dapat memberikan saya kesempatan untuk memperlihatkan keterampilan saya dan mengeksplorasi kreativitas saya dalam membuat karya animasi. Saya berharap dapat memperoleh umpan balik konstruktif dari para ahli dan peserta lain, yang dapat membantu saya untuk terus meningkatkan kualitas dan kreativitas karya saya.

Terakhir, harapan saya setelah mengikuti pelatihan dasar CEMPOR 2023 adalah dapat menerapkan semua yang saya pelajari dan terus berkembang dalam industri animasi, serta berkontribusi dalam menciptakan karya-karya animasi yang inspiratif dan berdampak positif bagi masyarakat.',
'pengertian_pengusaha' => 'Pengusaha yaitu satu dari sekian banyak profesi dalam bidang kerja. Pengusaha adalah seseorang, kelompok, ataupun lembaga yang melakukan kegiatan jual, beli, atau sewa sesuatu. seorang pengusaha identik dengan karakter kerja keras, disiplin, dan tanggung jawabnya. menjadi pengusaha dapat memberikan lapangan pekerjaan bagi orang lain.',
'satusatunya' => 'Saat ini saya belum memiliki usaha namun tertarik mendalami ilmu kewirausahaan agar dimasa depan memiliki usaha yang dapat membuka lapangan kerja, dan ikut serta dalam berkontribusi menaikkan perekonomian keluarga serta orang sekitar saya. bidang usaha yang paling saya minati itu industri kreatif dimana saya memiliki usaha percetakan dan studio sendiri.',
'cocok_pengusaha' => 'Saya memiliki berbagai ide yang inovatif untuk dijadikan usaha dan terobosan baru untuk diaplikasikan ke bisnis, namun perlu adanya dukungan pengetahuan, modal serta strategi untuk mengantisipasi kegagalan.',
