'pelatihan_lainnya' => 'Belum pernah',
'komunitas' => '-',
'ig_komunitas' => '-',
'profil_komunitas' => '-',
'tentang_diri' => 'Saya hanya anak berusia 17 tahun yang begitu mencintai seni baik dalam bentuk gambar, musik,  tulisan, foto, bahkan makanan. Saya suka menggambar, media tradisional atau pun media digital keduanya saya sukai. Kelebihan saya berada pada media digital. Saya pun suka membuat komik dalam bentuk webtoon dan manga(komik Jepang). Terkadang saya pun membuat animasi seperti kartun Jepang. Artstyle saya bisa dibilang artstyle yang cerah dan ceria, namun sebenarnya saya lebih suka menggambar yang sebaliknya(sedih dan gelap). Saya belajar menggambar dari diri sendiri.',
'plus_minus_diri' => 'Kekurangan saya, saya cepat sekali merasa down dan tidak pede terhadap hasil karya saya. Saya sering merasa tidak puas dengan hasilnya, padahal teman-teman saya begitu suka dengan karyanya. Saya pun sering kehilangan motivasi gambar saya, padahal inspirasi/ide saya terbilang cukup banyak dan lancar. Bila dipaksa, saya bisa burnout dan akan lama untuk bangkit. Saya pun tipe orang yang takut mencoba hal baru, tidak jarang saya berhenti sebelum saya mencoba. Namun kelebihan saya, saat ketika motivasi saya muncul saya bisa terus menggambar tanpa berhenti. Saya begitu menyukai membuat garis dan goresan yang di buatnya. Saya pun suka sekali melihat warna-warna yang indah yang telah saya buat. Saya pun sering penasaran dengan pendapat orang lain. Saya pun terkenal dengan orang yang tekun dan teliti dalam waktu yang lama. Mengerjakan project besar dan deadline bukanlah masalah buatku. Saya sedikit perfectionist, namun saya menikmati setiap proses gambar itu.',
'prestasi_diri' => 'Apakah membuat commissioner senang dengan hasil gambar kita adalah sebuah prestasi? Bila bukan, maka.. Saya telah mengikuti banyak perlombaan menggambar, saya paling senang dengan 1 lomba di mana saya memenangkan juara 3 dalam menggambar manga. Saya hanya senang dapat mengikuti kontes menggambar.',
'kegagalan' => 'Tidak ada. Yang saya sesali hanya mengapa saya tidak memberi waktu istirahat pada diri saya sendiri saat menggambar waktu itu. Meski saya begitu menyukainya, namun itu begitu menyakitkan.',
'impian' => 'Mungkin membuat manga? Membuat banyak gambar, artbook, merch-merch lain seperti gantungan kunci, dan kalau boleh sih pengen banget jadi illustratornya K-POP grup SEVENTEEN. Mereka adalah inspirasi saya.',
'wawasan_latsar' => 'Kata guru saya, sih. Kalau hasil saya bagus maka saya bisa dibina ke tahap-tahap berikutnya. Trus kalau masih bagus, nanti masuk tahap inkubasi. Kalau  di tahap inkubasi terpilih, nanti masuk ke cempor CAMP. Kata guru saya itu biasanya diajarin gimana caranya skill yang kita bisa jadi suatu usaha dan dibantu juga dari segi koneksi dan relasi. Dispora yang mengadakannya.',
