'anak_ke_berapa' => '1',
'anak_ke_berapa_dari' => '1',
'harapan' => 'Saya ingin bisa menggambar tanpa ada rasa tidak puas dengan hasil karya saya. Saya pun ingin bisa berguna bagi keluarga. Saya ingin teman-teman saya (terutama adik kelas berharga saya) dapat merasa bangga menjadikan saya sebagai teman mereka. Saya pun ingin menghormati dan berterima kasih kepada pihak sekolah yang telah mendukung saya selama 3 tahun ini.',
'pengertian_pengusaha' => 'Seseorang yang mau berusaha untuk dirinya, keluarga, atau orang lain. Seseorang yang mau menjadi pribadi yang lebih baik dan berusaha untuk tetap maju.',
'satusatunya' => 'Sepertinya?',
'cocok_pengusaha' => 'Ayah saya!',
'jika_tidak_jadi_pengusaha' => 'Bila bukan dalam bidang gambar, mungkin musik? Saya ingin coba bisnis atau hukum.. Mungkin psikologi juga?',
