'ig_komunitas' => NULL,
'profil_komunitas' => NULL,
'tentang_diri' => 'Saya Irvan Al Fauzi, lulusan baru SMK jurusan farmasi industri. Setiap menjadi panitia dalam sebuah event saya dipercayai teman-teman saya untuk menjadi pundekdok/pembuat design grafis (meskipun sebenernya saya cuma tau hal-hal basicnya saja). Saya orangnya fleksibel, kalem, introvert, suka berpuisi dan emosional ketika ada hal yang begitu berkesan (berperasa). Saya mendeskripsikan diri saya sebagai INFP.',
'plus_minus_diri' => 'Kekurangan :
Kurang percaya diri
