'prestasi_diri' => 'Ikut olimpiade IPA saat kelas 3 SD di ITB
UN 3 besar saat SD
UN 10 Besar saat SMP
Ranking 1 di setiap semester 2 saat SMP
Lagu terbaik saat tugas akhir mapel seni musik saat SMP',
'kegagalan' => 'Salah pilih jurusan saat SMK, salah pilih sekolahnya juga.
Tidak memperbaiki hubungan dengan ayah saat masih kecil',
'impian' => 'Untuk 5 tahun mendatang, sepertinya saya akan berkuliah di jurusan yang lain.
Mungkin bukan 5 tahun tapi lebih. Saya ingin membuat museum/pameran/tempat wisata bertemakan "merayakan kegagalan". Banyak orang yang menganggap kegagalan adalah hal yang tabu dan memalukan. Padahal kegagalan adalah hal penting dalam pertumbuhan. Perlu ada peran psikolog dalam hal ini. Jadi disana kita akan mengenal jenis kegagalan yang baru saja atau pernah dialami, lalu menuangkan segala emosi yang disebabkan oleh kegagalan tersebut. Sampai akhirnya healing dan melakukan evaluasi diri dari kegagalan tersebut. Di sana juga diberitahu jika kegagalan adalah hal yang wajar terjadi, dan kita selalu mengalaminya di kehidupan sehari-hari dalam hal-hal kecil. (Jgn dicuri idenya ya kak)',
'wawasan_latsar' => 'LATSAR CEMPOR adalah program pelatihan dasar yang berfokus pada bidang produksi. Tujuannya adalah untuk melatih peserta dan membantu mereka memahami tingkat kerumitan serta risiko dalam proses produksi. Peserta yang berhasil melewati tes dari LATSAR akan berkesempatan untuk mengikuti kegiatan lanjutan yang disebut INKUBASI yg mencakup pendampingan, asistensi, expo, dan apresiasi di CAMP. 

