    'plus_minus_diri' => 'Kekurangan saya, saya terlalu berenergik yang menjadikan saya terkesan terlihat terburu - buru, tetapi dengan saya yang berenergik, saya bersemangat melakukan pekerjaan yang saya kerjakan dengan perasaan hati yang senang dan enjoy mengerjakannya. 

