    'pelatihan_dispora_sebelumnya' => 'Belum pernah',
    'pelatihan_lainnya' => 'belum pernah',
    'komunitas' => NULL,
    'ig_komunitas' => NULL,
    'profil_komunitas' => NULL,
    'tentang_diri' => 'Saya adalah pribadi yang senang mempelajari hal baru, pantang menyerah, dan dapat bekerja secara individu maupun tim. Saya memiliki ketertarikan dalam bidang pendidikan, bisnis, seni, dan pengembangan diri. Saya tergabung menjadi tutor bimbingan belajar dan kegiatan relawan kependidikan. Selain itu, saya turut membuat konten tentang pengembangan diri yang dipublikasikan di sosial media.',
    'plus_minus_diri' => 'Kekurangan yang saya miliki adalah saya cenderung mudah panik dan overthinking, sedangkan kelebihan yang saya miliki adalah pekerja keras, detil, dan adaptif.',
'prestasi_diri' => 'Prestasi yang menurut saya paling membanggakan adalah ketika saya dan tim berhasil lolos didanai oleh dikti untuk Program Kreativitas Mahasiswa bidang Kewirausahaan (PKM-K). Saya dan tim berhasil untuk lolos dan diberikan kesempatan dalam mengembangkan usaha dengan prinsip-prinsip Suistanable Living.',
    'kegagalan' => 'Kegagalan yang membuat saya menyesal adalah ketika saya gagal masuk ke SMA yang saya inginkan sejak lama. Saya telah berusaha dengan keras, belajar dengan giat, tetapi saya harus terlempar ke sekolah lain.',
    'impian' => 'Saya memiliki beberapa impian yang ingin diraih dalam rentang waktu 5 tahun mendatang. Setelah saya menempuh pendidikan profesi guru dan memperoleh sertifikat pendidik, saya berencana mengikuti tes PPPK dan lolos diterima. Selain itu, saya pun bercita-cita untuk mengembangkan usaha dalam bidang Food and Beverages. Saya berencana untuk menyajikan produk yang unik, sustain, dan sehat serta disesuaikan dengan target pasar saya. Kemudian, saya pun ingin senantiasa membangun dan mengembangkan akun sosial media saya dengan menyajikan konten-konten informatif mengenai pendidikan, self-development, dan produktivitas. Dengan menyajikan konten-konten tersebut, saya berharap bahwa saya dapat memberikan manfaat dan kebaikan bagi orang banyak.',
    'wawasan_latsar' => 'Pelatihan yang saya ikuti adalah pelatihan konten kreator. Pada pelatihan tersebut saya akan memperoleh pengetahuan dan pengembangan keterampilan mengenai cara membuat konten, mencari ide konten, menyusun konten yang menarik, dan cara menyajikan konten.',
    'komitmen' => 'Bersedia',
    'anak_ke_berapa' => '1',
    'anak_ke_berapa_dari' => '1',
    'harapan' => 'Harapan saya setelah mengikuti pelatihan tersebut adalah saya mampu meningkatkan kemampuan saya dalam membuat konten. Dengan demikian, konten yang saya sajikan lebih menarik, apik, informatif, dan mampu menjangkau khalayak ramai.',
    'pengertian_pengusaha' => 'Menurut saya, pengusaha adalah seseorang yang mampu menemukan dan mengambil peluang serta menciptakan ide-ide kreatif dan inovatif sehingga mampu menyejahterakan dirinya dan orang-orang yang terlibat dalam hal tersebut.',
    'satusatunya' => 'Menurut saya, peran sebagai pengusaha cocok dengan saya. Namun, saya pun tidak menutup kemungkinan peran lain yang dapat saya jalani.',
    'cocok_pengusaha' => 'Hal-hal yang membuat saya cocok menjadi pengusaha adalah saya adalah pribadi yang penuh pertimbangan, tetapi mampu mengambil keputusan; saya berkemauan kuat, tetapi mendengarkan masukan dari orang-orang sekitar; saya mampu beradaptasi dengan perkembangan yang terjadi sehingga dapat menyesuaikan; dan saya memiliki ide-ide yang apabila dikembangkan tentunya mampu menjadi peluang yang menjanjikan.',
