Kumpulkan gaji dan hasil usaha 

- R Relevant (Sesuai)
Ingin memiliki tabungan untuk rumah Dan naungan pemuda nanti, dengan asumsi biaya tabungan gaji yang meningkat 15% per tahun, artinya  perlu set tujuan usaha dengan profit yang di dapat dapat membantu hasil yang optimal atau lebih cepat

- T Timebound (Batas Waktu)
