    'facebook' => NULL,
    'twitter' => NULL,
'alasan' => 'Menurut saya generasi muda harus berani memulai berwirausaha terutama di era industri 4.0. Salah satunya karena di era berbasis internet ini jangkauan pasar akan lebih luas sehingga memberi peluang yang lebih besar. Yan saya ketahui Kegiatan Latsar Cempora Dispora Kota Bandung merupakan program untuk meningkatkan kapasitas pemuda di Bandung. Pada saat kuliah dulu, saya gemar mengikuti perlombaan terkait bisnis seperti yang pernah saya ikuti yaitu Business Plan Competition di Universitas Udayana Bali (Semi-finalist), kemudian saya pernah juga mengikuti Business Plan Competition di Institut Kalbis, Jakarta (Finalist). Oleh karena itu, alasan saya mengikuti kegiatan Latsar Cempor Dispora Kota Bandung adalah karena saat ini saya ingin meningkatkan skill, menambah relasi, meningkatkan jiwa kepemimpinan dalam kewirausahaan yang kreatif dan inspiratif. Selain itu, karena saya senang baking, dengan adanya kesempatan training pastry & bakery saya sangat bersemangat untuk mengikuti kegiatan ini.',
