    'pelatihan_dispora_sebelumnya' => 'belum pernah',
    'pelatihan_lainnya' => 'belum pernah',
    'komunitas' => NULL,
    'ig_komunitas' => NULL,
    'profil_komunitas' => NULL,
'tentang_diri' => 'Nama saya adalah Siti Nurjanah, lahir di Lampung, 31 Mei 2000, saya adalah anak kedua dari dua bersaudara, dari pasangan Suharto dan Suparmi. Siti adalah nama panggilan saya, saya terlahir di keluarga yang sederhana, ayahnya seorang karyawan swasta, sedangkan ibunya bekerja sebagai Ibu Rumah Tangga (IRT). Sejak kecil, saya selalu dinasehati oleh orang tua saya untuk selalu rajin beribadah, jujur dan baik terhadap sesama sehingga saya tumbuh menjadi seseorang yang pekerja keras, tanggung jawab, mudah bergaul, dan memiliki tekad yang kuat.',
    'plus_minus_diri' => 'Saya merupakan orang yang selalu senang belajar hal-hal baru, dapat bekerjasama dengan baik, mampu mengelola emosi dengan baik, merupakan orang mandiri, namun saya memiliki beberapa kekurangan seperti terlalu perfeksionis.',
'prestasi_diri' => 'Menerima Pendanaan dari Kemenristekdikti melalui Ditjen. Belmawa (Direktorat Jenderal Pembelajaran dan Kemahasiswaan) pada Program Kreativitas Mahasiswa (PKM-KC).',
    'kegagalan' => 'Kegagalan yang membuat menyesal adalah ditahun 2022 lalu, dimana saya sudah diberikan kesempatan lulus pada tes BUMN, namun karena pada saat itu waktunya berbarengan dengan saya proses pindahan ke Bandung sehingga kurang waktu untuk mempersiapkan tahap interview tersebut dengan baik sehingga saya tidak lulus. Dengan demikian, pelajaran yang bisa saya ambil adalah segala sesuatu harus dipersiapkan dengan baik.',
    'impian' => 'Impian saya di 5 tahun mendatang adalah saya menjadi pengusaha di bidang kuliner terutama bidang pastry & bakery dan kuliner lainnya seperti bebek yang dapat memperkerjakan karyawan sehingga membuka lowongan kerja baru.',
    'wawasan_latsar' => 'Yang saya ketahui  terkait pelatihan pastry dan bakery ini adalah pelatihan yang dirancang untuk mempersiapkan pemuda-pemudi agar mampu dalam memahami pengetahuan dan keterampilan dasar yang dibutuhkan seorang baker dalam menjalankan tugasnya dan dapat berwirausaha mandiri.',
    'komitmen' => 'Bersedia',
    'anak_ke_berapa' => '2',
    'anak_ke_berapa_dari' => '4',
    'harapan' => 'Harapan saya setelah mengikuti pelatihan ini adalah menambah skill saya dalam baking, menambah relasi saya dalam dunia bisnis, dan point penting harapannya adalah ditahun ini saya berani untuk memulai bisnis.',
    'pengertian_pengusaha' => 'Menurut saya pengusaha adalah seseorang yang mampu melihat peluang dengan melakukan inovasi demi menciptakan bisnis baru dengan segala resiko yang ada dengan tujuan mencapai keuntungan.',
    'satusatunya' => 'Iya, salah satu peran yang cocok dengan saya selain saya menjadi engineer. Hal tersebut, karena pada saat kuliah dulu saya sudah sempat memulai bisnis dengan berjualan nasi bakar, kemudian pada saat pandemi saya mencoba berjualan buah keripik kering buah-buahan, namun belum bertahan sampai saat ini.',
    'cocok_pengusaha' => 'Saya merupakan orang yang senang mencoba dan berani ambil risiko, tidak gengsian, dan suka menciptkan ide-ide kreatif.',
