'ig_komunitas' => '-',
'profil_komunitas' => '-',
'tentang_diri' => 'Saya Humaira Salsabila seorang mahasiswi dari Pendidikan Akuntansi UPI semester 4. Saya menyukai hal terkait endorsment dan menjadi salah satu anggota di Cloude Management untuk menjadi KOL sebuah produk agar dipromosikan oleh saya. Saya seneng membuat konten di Instagram tetapi saya merasa bahwa endorsment ini tidak branding diri saya lebih dalam dalam kemampuan membuat konten karena hanya melakukan review saja. Saya ingin mulai belajar menjadi konten kreator di YouTube agar bisa memberikan insight pada orang lain sesuai bidang yang akan saya tekuni.',
