'instagram' => NULL,
'facebook' => NULL,
'twitter' => NULL,
'alasan' => 'Saat ini saya sedang mengembangkan keahlian saya dengan menjadi Konten Kreator. Fokus konten yang dibuat yaitu menyajikan review dan rekomendasi caffe, coffeshop, resto, dan tempat-tempat yang bisa dikunjungi di Kota Bandung. Dengan mengikuti Latsar Cempor ini saya berharap mendapatkan pengetahuan, tips, dan trik menjadi konten kreator yang baik melalui sharing konten yang saya berikan.',
'usaha' => 'Belum',
'kendalau_saha' => 'Saat ini saya baru terjun ke dalam dunia konten kreator. Fokus konten saya adalah review dan rekomendasi caffe, coffeshop, resto, dan tempat-tempat yang bisa dikunjungi di Kota Bandung untuk memasarkan keciamikan Kota Bandung. Saat ini kendala yang saya alami adalah menentukan target penonton, membuat konten yang menarik, dan public speaking yang digunakan untuk voice over agar terdengar menarik dan tidak membosankan. Selain itu, saya belum menemukan ciri khas yang ada pada diri saya agar dapat diingat oleh audience.',
'sekilas_usaha' => 'aat ini saya baru terjun ke dalam dunia konten kreator. Fokus konten saya adalah review dan rekomendasi caffe, coffeshop, resto, dan tempat-tempat yang bisa dikunjungi di Kota Bandung untuk memasarkan keciamikan Kota Bandung. Konten yang saya buat, saya unggah melalui aplikasi Tiktok dan Instagram.',
