'pelatihan_lainnya' => '-',
'komunitas' => '-',
'ig_komunitas' => '-',
'profil_komunitas' => '-',
'tentang_diri' => 'Saya adalah perempuan berusia 26 tahun bernama Dinda. Saat ini kesibukan saya adalah bekerja di perusahaan farmasi dan sedang mengerjakan thesis magister saya di bidang pemasaran. Secara pararel, saya juga terjun ke dunia konten kreator dengan memberikan informasi mengenai tempat-tempat yang bisa dikunjungi di Kota Bandung. Mengunjungi tempat-tempat baru merupakan salah satu hobi saya, oleh sebab itu, saya ingin hobi saya ini juga dapat bermanfaat untuk teman-teman sekitar yang membutuhkan rekomendasi mau kemana di Bandung.',
'plus_minus_diri' => 'Kekurangan yang saya miliki adalah, 
- manajemen waktu yang kurang baik antara bekerja, kuliah, dan membuat konten. Namun, saya mensiasati dengan membuat jadwal dan berusaha patuh pada jadwal tersebut
- terlalu idealis, sehingga terkadang berhenti untuk merealisasikan sebuah project karena dinilai kurang sempurna
- public speaking yang kurang baik. terkadang gugup saat menyampaikan hal hal penting atau dengan lawan bicara yang lebih tinggi

Kelebihan yang saya miliki
- Peka terhadap hal sekitar sehingga cepat tanggap terhadap permasalahan yang terjadi
- Problem solving yang baik
- Terbiasa menjadi pemimpin dalam sebuah kelompok',
'prestasi_diri' => 'Prestasi yang cukup membahagiakan untuk diri saya adalah dengan pernah menjadi salah satu delegasi konferensi internasional di Jepang. Konferensi tersebut membahas inovasi teknologi yang ada saat itu dan di masa depan.',
'kegagalan' => 'Saya seringkali gagal dalam banyak hal. entah hal besar maupun hal kecil. Namun, tidak pernah saya menyesal dengan kegagalan itu. Karena kegagalan itulah yang membuat diri saya seperti sekarang.',
'impian' => 'Dalam 5 tahun ke depan saya ingin tetap bekerja dan mencari ilmu dari sumber apapun untuk meningkatkan kapabilitas dan kemampuan diri untuk itu, saya ingin
