'sekilas_usaha' => 'Saat ini saya menjalankan usaha di Bidang Petshop dan Peternakan Kelinci. Ternak kelinci dilakukan skala hobi dengan memproduksi jenis-jenis kelinci hias tertentu. Untuk petshop saya menjadi salah satu penyedia kebutuhan makanan dan perlengkapan hewan baik offline dan online, melayani jasa perawatan dan pengobatan yang saya tangani sendiri , serta penitipan. Spesialisasi di kelinci. Dan Tahun ini sedang berinovasi memproduksi snack (cemilan) untuk hewan kecil (small pets)',
