'plus_minus_diri' => 'Saya suka menghabiskan waktu sendiri untuk berinovasi dan memikirkan rencana usaha dan rencana kehidupan. Namun rencana yang telah dipikirkan selalu didiskusikan dengan orang yang saya percaya. Selalu menyusun rencana secara detail, namun terkadang terlalu lama untuk berpikir. Tetapi selalu berusahan untuk menikmati proses dalam mencapai impian yang ditetapkan.',
