'kegagalan' => 'Selama menjalankan hidup khususnya di Bidang Usaha, ada banyak sekali kesalahan, kegagalan yang saya alami mulai dari kesalahan berinvestasi, pengelolaan keuangan, management usaha secara umum, dll. Namun semua berhasil dilalui.

