'impian' => 'Memperluas usaha yang dijalankan dengan menitikberatkan di perluasan kebermanfaataan sesama manusia. Dan menjadi seorang konten kreator yang tujuannya dapat mengembangkan usaha dan memberikan atau berbagi ilmu,',
