'pengertian_pengusaha' => 'Seseorang yang selalu berpikir dan menciptakan produk yang menjadi sebuah jawaban dari sebuah permasalahan. Pengusaha yang baik selalu berusaha untuk fokus dalam memberikan manfaat kepada sesama.',
'satusatunya' => 'Iya. Menjadi pengusaha adalah salah peran yang sangat berat untuk dijalani, menjadi pengusaha mungkin bisa jadi harapan bagi banyak orang. Namun, hanya beberapa saja yang berani mengambil resiko atau memperjuangkan menjadi pengusaha. Dan saya selalu berusaha untuk berjuang mempertahankan status dan peran sebagai pengusaha.',
