'tentang_diri' => 'saya selalu semangat dalam menjalankan pekerjaan, mampu memimpin dalam sebuah ke anggotaan dan selalu berfikir idealis. saya senang sekali untuk berbagi ilmu pada siapapun sehingga saya sudah memiliki pengalaman memberikan pembelajaran di kampus, sering menjadi pembicara di beberapa sekolah di Indonesia dan pernah di undang menjadi pembicara di Rumah Sakit dengan standar Internasional. keahlian yang lain, saya miliki adalah mampu membuat konten kreatif di sosial media dan mendesain gambar menggunakan Photoshop dan Corel Draw. saat ini saya bekerja sebagai dosen, konten kreator, humas dan marketing',
'plus_minus_diri' => '1.	Keandalan dan Ketekunan: Saya adalah individu yang dapat diandalkan dan konsisten dalam menjalankan tugas-tugas saya. Saya memiliki kemampuan untuk tetap fokus pada pekerjaan dan menyelesaikannya dengan penuh ketekunan.
2.	Keuletan dan Ketekunan: Saya memiliki tekad yang kuat untuk mencapai tujuan yang telah ditetapkan. Saya rela bekerja keras dan tidak mudah menyerah ketika menghadapi tantangan dalam pekerjaan. Saya memiliki ketahanan mental yang tinggi untuk terus berusaha dan mencapai hasil yang diinginkan.
3.	Tanggung Jawab yang Tinggi: Saya sangat bertanggung jawab terhadap tugas-tugas yang diberikan kepada saya. Saya dapat diandalkan untuk menyelesaikan pekerjaan tepat waktu dan dengan kualitas yang baik. Saya mengutamakan integritas dan memegang teguh komitmen saya.
4.	Kreativitas dan Ketelitian: Saya memiliki pandangan yang unik dan kreatif terhadap pekerjaan. Saya memiliki kemampuan untuk melihat detail dan memberikan sentuhan estetika yang unik dalam tugas-tugas saya. Saya cenderung memiliki kepekaan terhadap keindahan dan desain.
Kelemahan Saya dalam bekerja:
1.	Keterlambatan dalam Mengambil Keputusan: Terkadang, Saya dapat terlalu hati-hati dan lambat dalam mengambil keputusan. Saya cenderung mempertimbangkan semua aspek dan risiko secara mendalam sebelum membuat keputusan, yang dapat memperlambat kemajuan dalam pekerjaan.
2.	Kekakuan dan Kecenderungan untuk Rutinitas: Saya mungkin memiliki kecenderungan untuk tetap pada rutinitas yang telah saya ciptakan. Saya mungkin enggan mencoba hal-hal baru atau mengubah cara saya bekerja, yang dapat menghambat inovasi dan adaptasi terhadap perubahan.
3.	Ketidakmampuan Mengatasi Stres: Saya cenderung menjadi stres dan cemas ketika saya merasa terbebani dengan tanggung jawab atau tekanan pekerjaan. Saya mungkin membutuhkan waktu ekstra untuk mengelola stres dan menemukan keseimbangan dalam kehidupan kerja.
4.	Kepentingan pada Kenyamanan: Saya cenderung mencari stabilitas dan kenyamanan dalam pekerjaan saya. Saya mungkin enggan mengambil risiko atau mencoba hal-hal baru yang di luar zona nyaman saya. Hal ini dapat menghambat pertumbuhan dan eksplorasi karir yang lebih luas.',
