'anak_ke_berapa_dari' => '4',
'harapan' => '1.	Keterampilan Konten yang Lebih Baik: Diharapkan bahwa saya pelatihan dapat mengembangkan keterampilan dalam menciptakan konten yang menarik dan efektif untuk mempromosikan kampus. Mereka akan memiliki pemahaman yang lebih baik tentang teknik-teknik konten kreator dan strategi pemasaran yang efektif.
2.	Kreativitas yang Lebih Berkembang: Saya pelatihan diharapkan dapat mengasah kreativitas mereka dalam menciptakan konten yang unik dan menarik. Mereka akan mampu menghasilkan ide-ide kreatif untuk membedakan promosi kampus dari pesaing.
3.	Peningkatan Jangkauan dan Interaksi: Setelah pelatihan, harapannya adalah saya dapat meningkatkan jangkauan konten promosi kampus mereka dan meningkatkan interaksi dengan audiens target. Mereka akan memiliki pemahaman tentang platform media sosial yang efektif dan strategi pemasaran digital untuk mencapai tujuan tersebut.
4.	Penyampaian Pesan yang Lebih Efektif: Saya pelatihan diharapkan dapat mengomunikasikan pesan promosi kampus dengan cara yang jelas, menarik, dan persuasif. Mereka akan dapat menyusun konten yang mempengaruhi audiens untuk tertarik dengan kampus dan ingin mengetahui lebih lanjut.
5.	Peningkatan Kesadaran dan Reputasi Kampus: Dengan keahlian yang ditingkatkan dalam menciptakan konten promosi, harapannya adalah kampus dapat memperoleh peningkatan kesadaran dan reputasi yang positif di kalangan target audiens. Ini akan membantu dalam menarik calon mahasiswa baru dan memperluas basis alumni.
6.	Kolaborasi dan Jaringan yang Lebih Luas: Setelah pelatihan, saya diharapkan dapat menjalin kolaborasi dengan konten kreator lainnya dan membangun jaringan yang lebih luas di industri tersebut. Ini akan membuka peluang untuk berbagi pengetahuan, pengalaman, dan peluang promosi bersama.',
'pengertian_pengusaha' => 'entrepreneurs adalah individu atau kelompok yang berdedikasi untuk menciptakan, mengembangkan, dan mengelola usaha atau bisnis. Mereka memiliki kecenderungan untuk mengambil risiko dalam rangka mencapai tujuan mereka, seperti menciptakan lapangan kerja, menghasilkan keuntungan, atau memberikan solusi inovatif bagi masyarakat. Pengusaha sering kali memiliki keterampilan kepemimpinan, kreativitas, keberanian, dan kemampuan mengambil keputusan yang baik. Mereka juga harus mampu mengatasi tantangan dan kesulitan yang mungkin muncul dalam menjalankan bisnis.',
