'profil_komunitas' => 'kelas inspirasi adalah komunitas yang berfokus pada pendidikan. komunitas ini mengumpulkan orang-orang yang sudah bekerja di bidangnya masing-masing, untuk mejadi inpirator dalam sehari bagi anak-anak SD pilihan.',
'tentang_diri' => 'Halo perkenalkan nama saya Fredi Handoko, saya biasanya di panggil Fredi. Saya adalah anak ke dua dari 3 bersaudara. Saya menyelesaikan studi S-1 di Fakultas Ilmu Sosial dan Politik di jurusan Ilmu Komunikasi dengan konsentrasi Public Relations â Universitas Bandar Lampung (UBL) pada tahun 2017. Saya pernah bekerja sebagai announcer di PT. Bintang Media Radio (Radio Kharisma FM), dan PT. Suara Alam Indah (Radio SAI FM), sebuah perusahaan yang bergerak di bidang media penyiaran. Pekerjaan terakhir saya saat ini adalah sebagai protokoler wali kota bandung sejak tahun 2018 sampai sekarang.
Saya adalah orang yang suka mempelajari hal-hal baru, sehingga dalam setiap kesempatan saya berniat untuk meningkatkan kemampuan di dalam diri saya sehingga bisa menjadi orang yang lebih baik lagi. Saya sudah memperkenalkan diri melalui keterampilan yang saya miliki mulai dari keterampilan dalam mengoperasikan komputer, mengerjakan event Formal dan Non Formal, Event Management, content creative, Master of Ceremony, Broadcasting, Public Speaking, Social Campaign, Social Volunteer, adaministrasi perkantoran, acara keprotokoleran dan kehumasan. 
