'plus_minus_diri' => 'kelebihan yang saya miliki mulai dari keterampilan dalam mengoperasikan komputer, mengerjakan event Formal dan Non Formal, Event Management, content creative, Master of Ceremony, Broadcasting, Public Speaking, Social Campaign, Social Volunteer, adaministrasi perkantoran, acara keprotokoleran dan kehumasan. 
kekurangan saya adalah terlalu perfeksionis sehingga ketika ada hal-hal yang tidak sesuai dengan ekspektasi saya, akan membuat saya menjadi overthinking.',
