'domisili_alamat_lengkap' => 'KOMP. GANESHA SECAPA TNI AD',
'domisili_rt' => 10,
'domisili_rw' => 6,
'domisili_file' => NULL,
'instagram' => NULL,
'facebook' => NULL,
'twitter' => NULL,
'alasan' => 'Saya adalah seorang lulusan baru yang ingin mencoba menjadi konten kreator, namun belum menemukan formulasi yang tepat agar konten saya mudah fyp di tiktok dan beranda sosial media lainnya, saya yakin dengan mengikuti pelatihan dari dispora Bandung akan menambah wawasan saya mengenai dunia konten kreator dan akan bisa bermanfaat untuk mengevaluasi konten yang saya buat kedepannya, agar menjadi lebih baik.',
'usaha' => 'Belum',
'kendalau_saha' => NULL,
'sekilas_usaha' => NULL,
'produk' => NULL,
'pelatihan_dispora_sebelumnya' => 'Pelatihan Desain Thinking (2017)',
'pelatihan_lainnya' => 'Digital marketing dan sosial media spesialis (Lembaga: tempatbealajar & RevoU)',
'komunitas' => NULL,
'ig_komunitas' => NULL,
'profil_komunitas' => NULL,
'tentang_diri' => 'Saya adalah anak pertama dari dua bersaudara, saya baru saja lulus dari universitas dengan program studi ilmu komunikasi. Saya sering terlibat dalam kegiatan kemahasiswaan seperti organisasi intra kampus. Saya tertarik dengan bidang digital terutama sosial media dan saya sedang menekuni hal yang saya suka lebih rutin saat ini, yaitu menulis. Saya memiliki blog pribadi yang mengulas tentang dunia sepakbola, dengan tujuan mengasah kemampuan saya akan dunia tulis menulis karena pekerjaan yang saya minati adalah copywriter, content writer, content creator dan digital marketing.',
'plus_minus_diri' => 'Kekurangan saya terkadang saya kurang percaya akan diri saya endiri dan kemampuan yang saya miliki, namun saya dapat mengatasinya dengan menonton atau melihat kutipan ataupun video-video motivasi yang dapat menyemangati diri saya agar tidak insecure dan percaya diri dalam mengambil kesempatan.

Kelebihan saya adalah dalam bidang menulis karena saya merasa passion saya berada disana dan juga saya senang menceritakan tentang hal saya ketahui jika saya sedang berkunjung ke suatu tempat, baik itu dengan teman atau pun keluarga. Saya rasa saya adalah seorang story teller yang menyenangkan bagi orang lain, maka dari itu selain menyukai bidang menulis saya juga menyukai bidang konten kreator walau pun saya lebih sering menggunggahnya ke story saya bukan ke feed. Saya juga seorang yang ambivert, yaitu kepribadian yang memiliki keunikan yang bisa menjadi introvert atau pribadi yang tetutup atau extrover pribadi yang terbuka dan bisa bergaul.',
'prestasi_diri' => 'Pada masa perkuliahan saya mengikuti beberapa organisasi dengan orientasi hasil yang lumayan menantang dan cukup berat, saya tergabung dalam organisasi KUPR atau Komisi Pemilihan Umum Raya di kampus saya, saya sebagai tim SDM berhasil menjalankan tugas KPUR dengan sangat baik dengan keberhasilan, yaitu terpilihnya Presiden Mahasiswa dan Wakil Presiden Mahasiswa yang baru dikala pandemi covid-19 sedang marak2nya. Selain itu saya juga tergabung di dalam organisasi DPM (Dewan Perwakilan Mahasiswa) yang mana kala itu baru saja memisahkan diri dari Legislatif kampus saya karena awalnya menyatu dengan MPM (Majelis Permusyawaratn Mahasiswa). Dengan begitu seluruh sosial media dari DPM kampus saya ini baru dan mulai dari 0 followers, tapi saya sebagai anggota KOMINFO dapat mengembangkan sosial media DPM dengan cukup baik dengan diisi beberapa konten yang menarik minat mahasiswa kala itu dan memiliki pencapaian hingga 500 lebih followers pada periode saat saya mejabat. Tak hanya itu, sayaun sebagai ketua program kreatif berhasil menghasil sebuah podcast yang dapat membranding organisasi saya mejadi lebih baik dan tentu saja lebih dikenal oleh mahasiswa khususnya dan oleh masyarakat umumnya.',
'kegagalan' => 'Salah satu kegagalan yang saya sesali dalam hidup saya adalah gagalnya saya dalam mengembangkan instragram yang dimiliki oleh kelas saya semasa kuliah, diakibatkan saya yang sibuk akan kuliah dan organisasi dan juga beberapa akun yang saya handle diluar perkuliahan menyebabkan akun instagram kelas saya menjadi pasif, jangan ada konten di dalamnya dan kurang menarik untuk orang banyak. Tentu saja semua pencapaian ini juga berkat pelatihan yang saya ikuti di dispora bandung tempo hari, yaitu desain thinking yang membuat saya dapat berpikir lebih maju daripada teman-teman saya dan menghasilkan sebuah ide yang out of the box.',
'impian' => 'Dalam 5 tahun mendatang saya harap saya dapat mewujudkan impian saya dan juga beberapa teman dengan mempunyai production house atau media sendiri, seperti volix, vindes, rans entertainment atau narasi mili Najwa Shihab. Tentunya itu akan diraih secara bertahap denga awalan saya mejadi karyawan sebuah perusahaan dengan posisi yang saya minati yaitu copywriter, content writer, sosial media spesialis dan juga konten kreator. Dimana saya akan saya akan menyerap semua ilmu yang saya peroleh dan mengambil langkah besar suatu saat nanti.',
'wawasan_latsar' => 'Yang saya ketahui mengenai konten kreator bukan hanya sekedar orang atau profesi yang membuat konten tak berdasar, artinya dalam setiap konten yang dibuat memiliki tujuan, baik edukasi, hiburan ataupun komersial. Seorang konten kreator sangat berpengaruh penting bagi perusahaan, bisa dibilang konten kreator adalah pekerjaan mirip slases namun promosinya sangat halus dan tak terlihat seperti promosi, maka dari itu banyak perusahaan saat ini memilih untuk merekrut konten kreator.',
'komitmen' => 'Bersedia',
'anak_ke_berapa' => '1',
'anak_ke_berapa_dari' => '3',
'harapan' => 'Harapan saya tentu saja jika saya berkesempatan untuk bisa mengikuti pelatihan ini adalah saya mendapatkan pengetahuan atau ilmu baru mengenai dunia konten kreator, dan tentu yang saya harapkan juga saya akan lebih dilirik oleh perusahaan untuk bekerja sebagai konten kreator atau bidang relevan lainnya.',
'pengertian_pengusaha' => 'Pengertian perusahaan menurut saya adalah sebuah tempat yang menjalankan sebuah usaha yang bergerak di berbagai macam bidang seperti barang atau pun jasa, perusahaan akan dibantu oleh karyawan dalam memproduksi barang atau jasa yang ia jual.',
'satusatunya' => 'Tentunya dalam hidup ini saya ingin meneladani rasul saya, yaitu Nabi Muhammad SAW yang berbicara menjadi seorang pedagang atau pengusaha adalah pekerjaan yang baik, dan saya rasa jika nanti ada kesempatan atau peluang untuk menjadi pengusaha saya akan mengambilnya, dan rasa saya akan cocok sebagai seorang pengusaha.',
'cocok_pengusaha' => 'Saya memiliki tekat yang kuat dalam diri saya untuk mewujudkan apa yang saya kehendaki selagi itu positif dan juga bermanfaat bagi diri saya, keluarga bahkan orang lain.',
'jika_tidak_jadi_pengusaha' => 'Saya akan bekerja sebagai digital marketer dimana profesi ini sedang diminati banyak perusahaan dengan prospek karier yang lumayan menjadikan untuk era modern saat ini.',
