'twitter' => NULL,
'alasan' => 'Saya sangat ingin memiliki kemampuan atau skill yang bisa saya gunakan untuk menjadi entrepreneur. Saya baru tahu bahwa Latsar Cempor Dispora Kota Bandung ini sering membuat acara untuk pemuda pemudi Kota Bandung untuk meningkatkan sumber daya manusia. Selain mendapat skill baru saya juga ingin sekali menambah pertemanan.',
'usaha' => 'Belum',
'kendalau_saha' => 'Dulu saya pernah menjalani beberapa usaha namun pada akhirnya harus berhenti dan beberapa memang betul-betul tidak terlaksana. Saya pikir saya belum mengetahui target saya itu siapa, kemana saya harus memasarkan produk saya dan sebagainya',
'sekilas_usaha' => 'Usaha saya dulu bergerak di bidang makanan dan jasa, namun saat ini saya ingin memiliki skill baru dan mencoba mengembangkan usaha baru',
