'pelatihan_lainnya' => 'belum pernah',
'komunitas' => NULL,
'ig_komunitas' => NULL,
'profil_komunitas' => NULL,
'tentang_diri' => 'Saya adalah wanita berusia 26 tahun yang saat ini bekerja secara freelance sebagai tutor bahasa Korea dan content creator (bahasa Korea). Saya tertarik untuk membuat produk body care namun kendala keuanganlah yang membuat saya masih berpikir untuk mengambil kelas. Saya adalah orang yang senang mengeksplore diri dengan belajar sesuatu yang baru',
'plus_minus_diri' => 'Kelebihan saya adalah saya senang untuk mengeksplor diri, mengembangkan bakat, mencoba hal baru dan mempunyai ide-ide yang bisa saya buat kedalam konten ataupun kedalam tujuan hidup saya.

Kekurangan saya adalah saya selalu berpikir untuk menjalankan semuanya dengan 99% sempurna dan ingin mendapatkan hasil sesuai dengan kerja keras saya, jadi terkadang saya harus bekerja lebih lama untuk memastikan semuanya sudah sesuai dengan keinginan saya dan saya hidup dengan sebuah prinsip yang telah saya pegang, kadang itu membuat saya susah berkembang,',
'prestasi_diri' => 'Saya berhasil menjuarai video pendek pembelajaran bahasa Korea. Namun jika ditanya pengalaman apa yang paling membanggakan adalah ketika saya dapat mengatasi rasa malu ketika harus menawarkan makanan yang ibu saya jual ketika bazar event.',
'kegagalan' => 'Prinsip saya dalam hidup adalah "tidak boleh ada penyesalan", saya akan belajar dari kesalahan, saya akan menganalisa kekurangan saya, saya yakin kegagalan adalah pelajaran berharga dan sebuah penundaan dari keberhasilan. Selama ada matahari yang terbit esok, maka masa depan saya masih dapat diubah.',
'impian' => 'Saya ingin membuka usaha Jasa, saya sudah lebih dari  3 tahun melamar pada perusahaan atau sekolah yang sesuai dengan bidang saya saat kuliah. Namun tidak adanya kesempatan yang diberikan membuat saya sedikit frustasi dan berpikir bahwa kunci sukses tidak hanya ada pada sebuah sekolah atau perusahaan. Saya ingin memiliki usaha yang dapat menopang kehidupan kedepannya dan juga membuka lapangan kerja apa bila usaha yang saya kelola dapat berkembang lebih besar.',
'wawasan_latsar' => 'Yang saya ketahui tentang produk body care adalah bahan dasar yang terkandung didalamnya. Contoh bahan dasar produk adalah emulsion maka hasil produk yang bisa dibuat adlah lotion, body butter, eye cream, sleeping mask dan moisturizer. Apabila bahan dasar body care adalah air, maka contoh produk yang bisa dihasilakan adalah face mist, jelly mask, facial mask, face serum dan hand wash',
'komitmen' => 'Bersedia',
'anak_ke_berapa' => '1',
'anak_ke_berapa_dari' => '3',
'harapan' => 'Saya harap ilmu yang saya pelajari bisa saya terapkan dan menjadi dasar saya untuk langkah awal menjadi seorang entrepreneur di bidang ini dan dapat mewujudkan impian saya yaitu sukses sebelum umur 30 tahun',
'pengertian_pengusaha' => 'Pengusaha artinya berusaha, berusaha semampu yang anda bisa untuk mewujudkan sebuah mimpi tanpa bekerja dibawah atasan. Tekanan, target, kegagalan pasti ada namun rasa nikmatnya akan sangat membahagiakan ketika kata sukses telah tiba',
'satusatunya' => 'Ya, pengusaha bukan berarti hanya menjual sebuah produk. Pengusaha dibidang jasapun bisa sangat menjanjikan. Saat ini saya juga mempunyai mimpi untuk menjadi pengusaha dibidang jasa, seperti jasa tourguide ataupun interpreter dan saat ini saya masih belajar untuk mewujudkan semua itu',
'cocok_pengusaha' => 'Saya tidak bisa hanya berdiam didepan komputer dan mengolah data. Saya memiliki ide-ide yang ingin saya salurkan, seperti membuat konten, photographer dan videographer kemudian juga public relation dan juga senang bertemu dengan orang-orang baruj yang memiliki satu visi dan misi.',
'jika_tidak_jadi_pengusaha' => 'Mungkin saya akan mengambil peran sebagai guru, tapi bukankah sebagai gurupun kita dapat membuka usaha dengan menjalankan sebuah tempat les? itulah kenapa saya sangat ingin menjadi seorang pengusaha',
