'alasan' => 'Ingin menambah skill terbaru untuk penunjang pekerjaan nantinya karena di zaman sekarang serba gadget dan tidak terlepas dalam video. Bisa untuk media promosi maupun bikin untuk koleksi pribadi. Sehingga, peluang besar ini dibutuhkan bagi belum pernah belajar/yang ingin menambah skillnya mengenai Content Creator seperti apa, belajar juga tentang peluang bisnis untuk tahun kedepannya jadi dikelola dengan baik untuk kebutuhan dalam bisnis.',
