'profil_komunitas' => NULL,
'tentang_diri' => 'Saya adalah orang yang menyukai ilmu baru dan ingin mencoba dalam berbagai hal. Dari percobaan ilmu baru ini bisa saya aplikasikan untuk bekerja maupun sebagai hobi. Saya juga menyukai detail setiap melakukan pekerjaan apapun. Sehingga, ketelitian saya ini meminimalisir kekurangan setiap pekerjaan dan belajar yang dibuat mengikuti sesuai arahan yang ada atau tutorial yang diberikan.',
'plus_minus_diri' => 'Kelebihan saya adalah selalu antusias dengan adanya berbagai ilmu baru yang dapat diterapkan, menyukai pada bidang creative dan teknologi, dan perfeksionis.

Kelemahan saya adalah setiap melakukan sesuatu selalu mengambil mood terlebih dahulu. Sehingga, yang saya lakukan untuk mengembalikan semangat bekerja, saya melakukan kegiatan menyenangkan dahulu seperti membuat teh/susu atau menonton/membuka sosial media dengan waktu dibutuhkan 15 menit diawal.',
'prestasi_diri' => 'Prestasi yang dapat membanggakan untuk saya adalah membuat suatu hasil karya dengan buatan sendiri dan digunakan atau dinikmati setiap saat oleh orang lain.',
'kegagalan' => 'Kegagalan yang membuat saya menyesal tidak mengambil kesempatan peluang untuk menambah skill baru walaupun tidak digunakan saat ini namun, pelajaran tersebut bisa digunakan kedepannya saat teknologi sudah berubah.

Intinya, tidak mengikuti perkembangan zaman dan tidak ikut untuk mencoba belajar pada perkembangan tersebut.',
'impian' => '5 tahun akan datang saya ingin mencapai impian sudah profesional dalam berkarir, sudah adanya tabungan masa depan, dan sudah mempunya side jobs belajar untuk berbisnis diawal tahun ini.',
'wawasan_latsar' => 'Content Creator belajar untuk mengedit video menarik, menambahkan copywriting teks menarik untuk dimasukkan kedalam video, membuat konsep video yang terencana dalam sebulan, 3 bulan, hingga tahun berikutnya sehingga isi konten video tersebut mengikuti rules konsep dan perkembangan update fenomena apa saja yang bisa dibuat video agar menarik orang melihatnya.',
