'anak_ke_berapa' => '4',
'anak_ke_berapa_dari' => '4',
'harapan' => 'Harapannya saya dapat ilmu dan bisa saya pelajari di rumah buat video menggunakan HP yang ada untuk menambah portofolio saya dalam editing video.',
'pengertian_pengusaha' => 'Pengusaha adalah orang yang memiliki usaha, pinter dalam berbisnis dan perhitungan, memiliki visi misi usaha yang jelas dalam usahanya sehingga meminimalisir bangkrut ditengah jalan, dan perlu adanya media promosi dalam penunjang usahanya tersebut agar ramai dibeli.',
'satusatunya' => 'Untuk saat ini belum karena saya ingin menjadi karyawan terlebih dahulu sambil menabung untuk 5 tahun kedepan untuk memulai dan siap terencana dalam berwirausaha / memiliki side job.',
'cocok_pengusaha' => 'Pintar dalam perhitungan, memiliki jiwa pantang menyerah, punya visi dan misi jangka panjang yang jelas dan detail, selalu mengikuti update terkini dan selalu belajar ilmu baru tentang pemahaman bisnis.',
