'tentang_diri' => 'Saya merupakan mahasiswa tingkat akhir pada jurusan Manajemen Pemasaran Pariwisata. Berada di dalam dunia pemasaran membuat Saya memiliki ketertarikan untuk mendalaminya. Saya memiliki keterampilan dalam fotografi, videografi, content planning dan copywriting. Dimana hal-hal tersebut merupakan elemen penting dalam pemasaran digital. Sempat menjadi anggota Unit Kegiatan Mahasiswa eSKa Radio UPI dan magang sebagai Marketing Communication di Hotel Four Points by Sheraton Bandung membuat Saya mempelajari ilmu komunikasi. Di dalam kehidupan pribadi Saya pun senang membuat konten seputar cafe, perjalanan wisata, dan fashion untuk di media sosial. Sebab itu, Saya senang mencari inspirasi dan mengembangkannya menjadi sesuatu yang baru',
'plus_minus_diri' => 'Kekurangan:
1. Saya tipe orang yang mudah bimbang
2. Ketika bekerja atau melaksanakan sesuatu Saya mudah terdistraksi oleh orang lain
3. Saya sering merasa sungkan terhadap orang lain
4. Sifat perfeksionis yang Saya miliki membuat Saya menyelesaikan pekerjaan sedikit lebih lambat karena sangat fokus

Kelebihan:
1. Selama ini Saya selalu menjadikan disiplin sebagai salah satu prinsip. Disiplin ini dalam segala hal, seperti berpakaian atau waktu
2. Ketekunan yang Saya miliki dapat menjadi hal yang bisa diandalkan.
3. Saya juga tipe orang yang dapat bekerja di bawah tekanan.
4. Komunikasi Saya cukup baik, mau itu kepada tim sendiri atau antar tim dan komunikasi di depan banyak orang.',
'prestasi_diri' => '1. Saya berhasil menjadi pemenang proyek desain logo yang ditugaskan dosen mata kuliah Digital Marketing
2. Saya berhasil membuat konsep dan narasi video spesial untuk wisudawan di jurusan dan diapresiasi oleh para dosen, para wisudawan dan mahasiswa lain.
3. Saya berhasil membuat kebaruan penampilan feeds Instagram Four Points by Sheraton Bandung saat menjadi trainee
4. Saya berhasil menjadi trainee terbaik pada saat magang di Four Points by Sheraton Bandung yang mana telah diakui oleh Marriott International
5. Saya dipercaya dan ditunjuk sebagai ketua divisi Digital Marketing periode 2021/2022 eSKa Radio UPI dan berhasil membuat konsep baru untuk Instagram',
'kegagalan' => 'Saya gagal menjalankan usaha makanan akibat kurang mampu manajemen waktu antara bisnis dan perkuliahan serta belum mampu konsisten dalam membuat konten dan memperbarui produk',
'impian' => 'Saya ingin menjadi Social Media Specialist dan Content Creator yang handal di suatu perusahaan. Juga di sisi lain dapat menjadi pengusaha yang sukses dengan berfokus kepada startegi pemasaran dan pengembangan produk.',
'wawasan_latsar' => 'Pelatihan ini merupakan kegiatan dari Dispora Bandung yang ditujukan kepada para wirausahawan atau para konten kreator sebagai upaya untuk meningkatkan skill dan knowledge mengenai pembuatan konten khususnya untuk mempromosikan suatu produk',
