'pengertian_pengusaha' => 'Pengusaha merupakan seorang yang mampu membaca situasi pasar, mempergunakan kreatifitasnya untuk memenuhi kebutuhan dan keinginan pasar yang mana dengan inovasinya dapat memberikan keuntungan kepada orang banyak',
