'tentang_diri' => 'Nama lengkap saya Mauna Yasmin Rahayu, biasa dipanggil yasmin. Anak ke 2 dari 2 bersaudara. Sekarang saya berstatus aktif sebagai mahasiswi semester 2 jurusan PAI di Universitas Islam Bandung, tapi tinggal di kota Cimahi. Saya belum memiliki pekerjaan, namun justru saya sedang mencari âpekerjaanâ. Ayah saya sudah meninggal 2 tahun lalu, maka dari itu saya bertekad untuk menyambung hidup dari minat dan bakat yang saya punya dalam bidang konten kreator di tiktok. Saya memiliki akun sosial media dengan followers minim tapi banyak orang yang tertarik dengan akun saya.',
