'kegagalan' => 'Kegagalan saya ketika tidak bisa memenuhi keinginan ayah saya sebelum meninggal. Karena sekarang keinginan itu sudah tidak berarti apa apa',
'impian' => '- menjadi konten kreator dengan followers minimal 1M di semua sosial media
