'impian' => 'Saya ingin menjadi seorang content creator yang sudah berfokus pada bahasan tertentu, ya walaupun tidak bisa secara langsung jadi secara spontan. Tapi intinya saya ingin mengalami kemajuan dalam hidup saya, semua itu mesti bertahap. Dan juga saya ingin menjadi awardee beasiswa dalam perjalanan kuliah ini. Serta saya ingin menjadi seorang publik speaker yang memiliki tingkat percaya diri yang kuat.',
'wawasan_latsar' => 'Yang saya ketahui, dari platform ataupun postingan di media sosial, pelatihan ini sangat sangat membantu bagi kami para pelajar yang mana memang sangat di butuhkan pelatihan pelatihan seperti ini, terutama ketika usia nya masih matang matangnya dan cocok u tuk masa masa upgrade diri.',
