'pengertian_pengusaha' => 'Menurut saya untuk menjadi seorang pengusaha yang sukses, kita harus bisa memunculkan ide-ide kreatif serta inovatif untuk menyelesai permasalahan yang ada pada kehidupan sehari-hari kita. Setelah itu, kita bisa mengembangkan hal tersebut sampai bisa memberikan keuntungan dan menjadi suatu proses mensejahterakan diri.',
