'jika_tidak_jadi_pengusaha' => 'Seperti yang sudah dijelaskan sebelumnya, saya akan mengambil profesi dalam bidang IT ataupun yang terkait dimana didalamnya terdapat bidang konten kreator. Maka dari itu saya berharap bisa mempelajari banyak hal dari pelatihan ini sehingga dapat berguna untuk meningkatkan daya jual serta kemampuan saya di profesi ini nanti.

