'tentang_diri' => 'Saya adalah seorang Freshgraduate mempunyai kemampuan dalam bidang komputer karna saya merupakan lulusan dari Teknik Komputer dan Jaringan, saya juga merupakan pribadi yang senang belajar hal baru,mudah beradaptasi, bertanggung jawab ,komunikatif dan aktif. Selama bersekolah saya aktif dalam ke organiasasiaan dan kepanitiaan di sekolah, saya mejabat sebagai ketua osis yang dimana menuntut saya untuk selalu meng kordinasi kan berbagai acara, membuat program dan memimpin rapat. Saya juga aktif dalam kegiatan kemasyarakatan, saya memgikuti Karang taruna kelurahan menjabat sebagai humas yang dimana menuntut saya untuk mau berkomunikasi dengan banyak orang. Saya juga pernah bekerja sebagai crew kithcen di Gucha burger dan di SAGALA group. Dunia F&B membuat saya jadi semakin senang belajar hal baru dan saya juga tertarik bekerja dalam bidang F&B.',
'plus_minus_diri' => 'Kelebihan saya adalah mudah beradaptasi dengan lingkungan baru, senang dengan public speaking, memiliki rasa kepemimpinan ,suka dengan kegiatan ke organisasiaan dan kemanusiaan, mengerti tentang dunia komputer , mampu mengaplikasikan MS. Office,canva,corel draw dan apk edit lainnya. Namun saya juga mempunyai kekurangan yaitu saya mudah pelupa, tapi hal itu selalu saya atasi dengan menuliskan hal hal penting tersebut dalam notes, dan juga terkadang saya kesulitan untuk memanagemen waktu,hal itu saya atasi dengan mengurutkan kegiatan / pekerjaan yang paling penting dan waktunya paling singkat.',
'prestasi_diri' => 'Prestasi yang paling membanggakan bagi saya adalah menjadi no 1 Top murid dengan nilai paling tinggi selama kelas 10-12, tentu hal itu menjadi tantangan besar bagi saya karna mempertahankan sesuatu itu tidaklah mudah, dan juga menjadi ketua osis merupakan hal yang membanggakan bagi saya, karna dengan itu leadership dan problem solving saya semakin dilatih.',
'kegagalan' => 'Gagal lolos PTN jalur SNM, hal itu membuat penyesalan bagi saya karna kurang giat dan kurang tepat memilih jurusan. Tapi hal itu tidak membuat saya putus asa untuk terus belajar dimanapun walaupun tidak bisa masuk PTN.',
'impian' => 'Mempunyai pekerjaan yang gaji nya cukup dan bisa untuk mengembangkan bisnis lebih besar lagi, ingin bisa membuat sebuah komunitas muda dan sekolah anak kurang mampu di pelosok desa,ingin tour ke berbagai daerah di indonesia sebagai volunteer, belajar dan liburan ke jepang dan luar negri lainya. Dan tak lupa juga, ingin sekali untuk bisa berangkat haji.',
