'alasan' => 'Di tengah zaman digitalisasi ini saya melihat bahwa sosial media adalah salah satu sarana marketing yang sedang naik. Dimana hampir setiap orang pasti menghabiskan waktunya untuk melihat sosial media. Maka dari itu melalui latsar cempor ini saya ingin melatih skill pembuatan konten saya agar lebih bisa bersaing dan menarik untuk dilihat orang. Sehingga kedepannya bahkan orang yang melihat tidak tahu bahwa sebenarnya mereka melihat konten promosi.',
