'tentang_diri' => 'Saya adalah lulusan baru dari manajemen upi yang sedang mencari pekerjaan. Saya dikenal aktif dan kreatif, semasa perkuliahan saya aktif dalam mengikuti berbagai organisasi dan merasa harus terus mengembangkan diri saya. Saya pernah mengikuti beberapa program magang yang berkaitan dengan kreatifitas, jurnalistik dan marketing.',
'plus_minus_diri' => 'Saya seringkali merasa gugup ketika bertemu orang baru, sehingga saya banyak melakukan persiapan sebelumnya agar lebih merasa siap. 
