'prestasi_diri' => 'Sedari kecil saya adalah anak yang telat berbicara dan gagap. Namun ada satu momen ketika masa perkuliahan saya ditunjuk untuk menjadi mc acara penerimaan mahasiswa baru se jurusan. Disana tentunya saya grogi karena itu adalah momen pertama saya diberi kepercayaan sebegitu besarnya, Namun saya tidak termakan ketakutan dan segera belajar ke beberapa teman yang terbiasa dan membuat berbagai persiapan. Alhamdulillahnya acaranya berhasil saya pandu dengan baik.',
'kegagalan' => 'Ketika masa perkuliahann saya pernah mengikuti lomba bisnis plan Bersama teman teman saya. Sayangnya kami gagal terpilih dan hanya sampai tahap jurusan saja. Hal ini dikarenakan kurangnya jiwa kepemimpinan di antara kami sehingga banyak terjadi miskom. Namun melalui pengalaman tersebut saya banyak belajar bagaimana cara berkomunikasi yang baik dalam tim hingga market research.',
'impian' => 'Di 5 tahun kedepan saya melihat diri saya bisa berhasil mengalahkan keraguan saya dalam berbisnis dengan membuat produk yang dikenal dan dipercaya oleh banyak orang. Saya juga ingin bisa berkontribusi secara aktif di roda perekonomian indonesia baik dengan mempekerjakan orang lain hingga  mempunyai suplier dari indonesia.',
'wawasan_latsar' => 'Pelatihan ini adalah sarana yang diberikan oleh Dinas Pemuda dan Olahraga Kota Bandung, kepada pemuda pemudi Bandung untuk menguasai berbagai course yang ada.  Dalam pelatihan konten kreator ini khususnya, pelatihan dasar mengenai pengambilan dan penyajian konten akan diberikan hingga berbagai mentoring dari ahlinya,',
