'pengertian_pengusaha' => 'Pengusaha adalah orang yang bisa mengubah suatu masalah justru menjadi peluang. Kekreatifan, keberanian, dan keinginan terus belajar  dalam mengambil resiko adalah hal yang pasti bagi seorang pengusaha.',
'satusatunya' => 'Saya selalu ingin menghasilkan produk yang bisa membuat senang pemiliknya. Maka dari itu pengusaha adalah pilihan saya yang utama dibandingkan pekerjaan yang lainnya.',
'cocok_pengusaha' => 'Saya melihat diri saya adalah orang yang kreatif dan mau belajar. Kedua hal itu membuat saya merasa memiliki pondasi awal untuk menjadi pengusaha.',
