'alasan' => 'Saya ingin memiliki keterampilan dalam membuat konten. Ingin mengetahui cara mencari ide konten, mempertahankan konsistensi membuat konten dan juga mengedit konten. Saya ingin menjadi seorang dosen oleh karena itu saya ingin memulai membuat konten edukasi mengenai ilmu kesejahteraan sosial di media sosial sebagai langkah awal untuk public speaking.',
'usaha' => 'Belum',
'kendalau_saha' => 'Saya belum memahami mengenai konsep meringkas suatu script konten menjadi durasi video yang singkat dan menarik perhatian orang. Selain itu, belum memahami mengenai editting konten.',
'sekilas_usaha' => NULL,
'produk' => NULL,
'pelatihan_dispora_sebelumnya' => 'belum pernah',
'pelatihan_lainnya' => 'Pelatihan Fasilitator Dukungan Psikosisal bagi Anak dan Orang Muda yang diselenggarakan oleh Save The Children Indonesia tahun 2022',
'komunitas' => 'Australia-Indonesia Youth Association Jawa Barat Chapter',
'ig_komunitas' => 'aiya_jawa_barat',
'profil_komunitas' => 'Organisasi ini menjadi wadah bagi kaum pemuda/i Australia dan Indonesia yang berada di Jawa Barat untuk saling mempelajari budaya, bahasa dan juga pengembangan kapasitas pemuda.',
'tentang_diri' => 'Saya merupakan penyandang disabilitas netra yaitu Low Vision atau keterbatasan pengelihatan. Namun, saya tidak pernah bersekolah di SLB karena pengelihatan saya masih sedikit jelas. Saya senang belajar hal baru baik melalui media ataupun secara langsung dengan berdiskusi dengan orang baru. Saya senang mempelajari bahasa asing seperti Bahasa Inggris dan Bahasa Prancis.',
'plus_minus_diri' => 'Kelebihan yang saya miliki saya suka tantangan dan belajar hal baru, saya memiliki kemampuan komunikasi yang baik, keterampilan manajemen waktu dan juga project management. Saya senang mengorganisir suatu kegiatan/ project mulai dari tahap penelitian, persiapa hingga pelaksanaannya. 
Kekurangan yang saya miliki saya cukup perfectionist sehingga membuat saya sering overthingking dan kurang puas dengan hasil kerja saya. Namun, hingga saat ini saya masih blajar dan berusaha untuk lebih realistis dan tidak terlalu banyak memikirkan hal di luar konteks.',
'prestasi_diri' => 'Saya pernah menjadi delegasi Kota Bandung untuk mengikuti Final Selection Pertukaran Pemuda Antar Negara tingkat Provinsi Jawa Barat tahun 2022 yang diselenggarakan oleh Kementerian Pemuda dan Olahraga Republik Indonesia secara daring.
Saya terpilih menjadi salah satu dari 31 peserta pelatihan Dukungan Psikososial bagi Anak dan Orang Muda yang diselenggarakan oleh Save The Children Indonesia yang terseleksi dari 400 lebih pendaftar seluruh Indonesia.
Saya juga pernah terpilih menjadi Camp Leader dalam Program Workcamp Indonesia-Japan Culture Exchange bersama 8 orang relawan Jepang dan 5 orang relawan Indonesia yang diselenggarakan oleh GREAT Indonesia pada bulan Januari 2023.',
'kegagalan' => 'Saya belum pernah mendapatkan kejuaraan lomba sejak saya sekolah sampai saat ini. Seperti mengikuti lomba pidato bahasa inggris dan mengikuti seleksi PPAN Kemenpora. Ada penyesalan andaikan saya belajar lebih giat bahkan sedini mungkin agar saya dapat menguasai suatu bidang kompetensi. Namun, hal tersebut tidak membuat saya patah semnagat dan terus mencoba serta membuka pinu-pintu kesempatan lain untuk masa depan yang lebih baik.',
'impian' => '5 tahun dari sekarang, saya ingin menjadi dosen ilmu pekerjaan sosial yang memiliki social enterprise (kewirausahaan sosial) untuk memberdayakan para penyandang disabilitas agar memiliki lapangan pekerjaan dan hidup mandiri. Dan dengan keterampilan menadi konten kreator saya dapat melatih  public speaking dan membentuk branding diri atau organisasi saya nantinya.',
'wawasan_latsar' => 'Pelatihan Konten kreator merupakan pelatihan yang diselenggarakan oleh Dispora kota Bandung yang bertujuan untuk memberikan keterampilan dalam membuat konten, cara membuat video yang menarik dan juga bagaimana public speaking untuk membuat konten. Melalui kegiatan pelatihan ini harapannya kaum muda memiliki kapasitas yang mumpuni sebagai modal usaha atau melamar di dunia kerja.',
'komitmen' => 'Bersedia',
'anak_ke_berapa' => '2',
'anak_ke_berapa_dari' => '2',
'harapan' => 'Harapannya saya mendapatkan ilmu dan wawasan mengeni konten kretor, dapat lebih percaya diri untuk membuat konten dan menjadi konten kreator serta menambah relasi dan jejaring.',
'pengertian_pengusaha' => 'Pengusaha adalah seseorang atau sekelompok orang yang melakukan kegiatan jual beli barang atau jasa guna mendapatkan keuntungan dan manfaat. Seorang pengusaha memiliki motivasi untuk mengaktualisasikan diri atau potensinya agar dapat memberikan manfaat melalui kegiatan usaha',
'satusatunya' => 'Tidak. Saya merasa memiliki berbagai potensi yang tidak harus menjadi pengusaha saja tapi juga bisa menjadi profesi lain seperti dosen. Namun bukan berarti saya tidak ingin menjadi pengusaha, saya juga ingin menjadi social entrepreneur (warausahawan sosial) yang memiliki usaha berdasarkan tujuan untuk mengatasi permasalahan sosial yang ada di masyarakat.',
'cocok_pengusaha' => 'Saya merupakan orang yang suka dengan tantangan dan belajar hal baru. Hal tersebut dapat menjadi kelebihan saya untuk menjadi pengusaha karena nantinya dalam dunia usaha tidak akan terhindar dari tantangan dan hambatan. Saya senang belajar dari pengalaman dan memknai kegagalan sebagai motivasi.',
'jika_tidak_jadi_pengusaha' => 'SAya akan menjadi dosen ilmu pekerjaan sosial karena saya senang belajar dan berbagi ilmu kepada orang lain. Melakukan pengabdian kepada masyarakat melalui kegiatan akademik adalah salah satu impian saya.',
'bidang' => 'SDM, Research & Development, Public Relation',
'bidang_spesifik' => 'Produksi, Keuangan, Penjualan, Pengembangan Bisnis, Sales & Marketing, Public Relationship',
