'usaha' => 'Sudah',
'kendalau_saha' => 'Untuk saat ini karena saya masih merintis usaha di Kampus, kendala yang cukup besar dalam mengembangkan usaha saya yaitu melebarkan wilayah usaha karena keterbatasan modal dan merumuskan strategi paling efektif untuk kondisi perekonomian saat ini',
'sekilas_usaha' => 'Usaha saya bernama AHOY, AHOY merupakan brand yang saya buat dan terdiri dari beberapa macam snack seperti keripik kaca, basreng, dan nyamnyam krispy. Untuk saat ini memang baru 3 menu saja yang baru bisa saya sajikan karena keterbatasan waktu dan menimbang efektivitas ketahanan produk',
