'pelatihan_dispora_sebelumnya' => 'Belum',
'pelatihan_lainnya' => 'Saya sebelumny pernah mengikuti pelatihan entrepreneur di yayasan Seruni Foundation dengan program Metamorepreneur semasa SMA sekitar 2018-2021',
'komunitas' => 'Saat ini saya tergabung sebagai Brand Ambassador Cicil Bandung',
'ig_komunitas' => 'cicil.co.id',
'profil_komunitas' => 'Cicil merupakan platform yang memfasilitasi mahasiswa untuk membayar SPP kuliah, pembelian pulsa, dan pembelian barang yang diperuntukan untuk kebutuhan kuliah. Platform ini sudah memiliki legalitas dari OJK dan merupakan tempat yang aman untuk mahasiswa memenuhi kebutuhan perkuliahan',
'tentang_diri' => 'Saat ini saya merupakan Mahasiswi Perguruan Tinggi semester 4 di Fakultas Peternakan Universitas Padjadjaran. Di tengah perkuliahan ini saya sedang mencari peluang untuk merintis usaha dan karir, maka dari itu saya juga tergabung dalam komunitas BA Cilcil serta Copywriting Space Kariermu. Saya juga tertarik untuk mempelajari bagaimana cara untuk memberikan pengaruh terhadap masyarakat luas maka dari itu saya berkeinginan untuk bergabung di Latsar Konten Kreator Kota Bandung.',
'plus_minus_diri' => 'Kelebihan
1. Mau belajar dan terus belajar untuk mendalami suatu bidang
2. Memiliki tekad untuk terus berkembang dengan mencoba hal-hal baru
3. Dapat menerima kritik dan saran, saya cukup terbuka untuk mendengar pendapat orang lain mengenai pekerjaan dan tugas yang saya kerjakan
4. Aktif di beberapa komunitas seperti Cicil dan Copywriting Space
5. Aktif di beberapa UKM dan Kepanitiaan kampus

Kekurangan
1. Sulit berpikir lebih kreatif atau out of the box karena keterbatasan pengalaman dan wawasan, maka dari itu saya ingin bergabung di Latsar Konten Kreator Kota Bandung 
2. Memiliki beberapa kesibukan diperkuliahan, namun saat ini saya terus berusaha untuk menyeimbangkan melalui time management yang terus ditingkatkan',
'prestasi_diri' => 'Untuk saat ini prestasi yang paling membanggakan bagi saya adalah tim PKM-RE saya berhasil lolos untuk mengikuti tahap 2 seleksi di SIMBELMAWA dan mendapat amanah sebagai Ketua Divisi Humas di beberapa event',
'kegagalan' => 'Di semester 1 yang lalu saya gagal untuk mendapatkan nilai IPK yang lebih memuaskan karena kesulitan dalam mengatur waktu yang baik dalam akademik dan kegiatan kampus, meskipun saat ini IPK saya Alhamdulillah dapat terus meningkat 
namun hal tersebut masih menyesakkan bila diingat',
'impian' => 'Dalam 5 tahun ke depan, pada tahun 2024 saya ingin bisnis saya bisa lebih besar lagi dengan penjualan minimal 2000 pcs/hari. Saya juga ingin lolos untuk mengikuti MBKM di DKPP Jabar. Lalu tahun berikutnya saya ingin wisuda tepat waktu sambil merintis usaha dengan ilmu yang sudah saya dapatkan. Ditahun berikutnya setelah modal cukup saya ingin membuat inovasi usaha yang berkaitan dengan bidang saya dipeternakan dan memanfaatkan ilmu kreator untuk mendukung kampanye GoGreen. 2 tahun berikutnya saya ingin fokus dalam usaha dan kampanye yang saya buat untuk membantu masyarakat luas sadar akan isu-isu peternakan, limbah, dan petingnya GoGreen',
'wawasan_latsar' => 'Yang saya ketahui dari pelatihan yang akan saya ikuti ini dibawahi oleh dispora kota bandung, dimana saya akan belajar bagaimana menjadi konten kreator, manajerial skill, marketting dan memanfaatkan ilmu didalamnya untuk mengembangkan potensi diri',
