'pengertian_pengusaha' => 'Menurut saya pengusaha atau entrepreneur merupakan sebutan bagi seseorang yang berkegiatan dalam menciptakan inovasi untuk meraih keuntungan',
'satusatunya' => 'Menurut saya iya, meskipun saya juga merasa cocok di bidang lain karena menurut saya memiliki potensi sebagai pengajar atau konten kreator. Tetapi memang, jika dibandingkan potensi saya akan lebih besar menjadi pengusaha',
