'twitter' => NULL,
'alasan' => 'Alasan saya mengikuti Pelatihan ini adalah dikarenakan saya perlu memahami industri konten kreator secara keselurahan serta mengasah kemampuan sebagai konten kreator yang menginspirasi dan menghasilkan penghasilan',
