'komunitas' => 'Goodpixelpro',
'ig_komunitas' => 'Goodpixelpro',
'profil_komunitas' => 'Explore tools yang memudahkan dalam berkarya atau berbisnis, membuat desain, web, logo, memanage sosial media',
'tentang_diri' => 'Nama saya Mia Dwi Cynthia biasa dipanggil Mia, lulusan Sistem Informasi di STMIK Amik Bandung pada tahun 2022,  Saya pernah menjadi Public Relations memberikan pengalaman memanage sosial media dimana diperlukan kreativitas, management, penggunaan tools editing foto dan video serta kemampuan analysis, selain itu membangun dan memelihara hubungan antara karyawan dan perusahaan dengan menciptakan berbagai budaya dan event begitu pula hubungan perusahaan dengan persahaan lain atau dengan masyarakat membantu saya meningkatkan jiwa sosialisasi. Saya bergabung dengan komunitas goodpixelpro yang membantu dalam mengelola sosial media, pembuatan web, logo serta insignt tools yang memudahkan para UMKM dalam menjalankan usahanya',
'plus_minus_diri' => '- Kekurangan yang saya miliki adalah kurangnya daya ingat terhadap materi yang sudah disampaikan sehingga saya mencatat materi dan melakukan management task untuk melakukannya step by step karena  kurangnya pengalaman dalam industri tersebut sehingga saya berusaha mendapatkan ilmu dan mempraktekkan ilmunya, learning by doing

Kelebihan yang saya miliki adalah saya memiliki kreativitas untuk mengekspresikan ide dan imajinasi dengan cara yang unik dan kreatif serta pemaanfaatan tools yang memudahkan dalam berkarya',
'prestasi_diri' => 'Prestasi yang paling membanggakan bagi saya adalah ketika mampu memenangkan kompetisi bisnis juara 3 dimana pada proses lomba tersebut mebantu menggali potensi yang belum saya sadari dan mampu melewatinya',
'kegagalan' => 'Menyia-nyiakan waktu dengan menghabiskannya bukan untuk mendapatkan pengalaman, kenalan dan uang. Mengabaikan kesempatan untuk mengembangkan diri, belajar, atau mengejar minat dan tujuan',
'impian' => 'Dalam 5 tahun kedepan saya memimpikan diri saya  sebagai konten kreator yang memiliki ciri khas dibidang digital dengan pemanfaatan tools yang bisa berguna bagi para kreator maupun yang menjalankan bisnis danadapat memaksimalkan penghasilan sebagai affiliate dari konten yang dapat menjadi inspirasi',
'wawasan_latsar' => 'Pelatihan yag akan saya ikuti akan mengasah 
- Keterampilan produksi konten yang mencakup pengetahuan dan keterampilan teknis yang diperlukan untuk menghasilkan konten berkualitas. 
- Mempelajari peralatan dan perangkat lunak yang relevan serta teknik-teknik kreatif untuk menghasilkan konten yang menarik.
- Kemampuan menulis yang baik sangat penting dalam dunia konten kreator.
