'domisili_file' => NULL,
'instagram' => NULL,
'facebook' => NULL,
'twitter' => NULL,
'alasan' => 'Saya ingin meningkatkan kemampuan dan pengalaman saya agar dapat memberikan kontribusi yang lebih besar dalam mendukung keberhasilan toko yang saya kelola. Saya yakin bahwa dengan mengembangkan keterampilan yang relevan dan memperluas pengetahuan saya, saya akan mampu memberikan layanan yang lebih baik kepada pelanggan, meningkatkan efisiensi operasional, dan berkontribusi secara signifikan pada pertumbuhan dan keberlanjutan toko ini. Saya percaya bahwa pengembangan diri adalah langkah penting dalam mencapai tujuan tersebut, dan saya berkomitmen untuk melakukannya dengan tekun dan disiplin.',
'usaha' => 'Sudah',
'kendalau_saha' => 'Saya kesusahan dalam mempromosikan online dan dikarenakan covid pelanggan menjadi berkurang',
'sekilas_usaha' => 'Usaha saya yang bernama Bimo Snack, sebuah usaha oleh-oleh dari Bandung yang berlokasi di Pal 3. Awalnya, kami memiliki sejumlah karyawan yang bertugas di toko kami. Namun, akibat dampak pandemi Covid-19, pendapatan kami mengalami penurunan signifikan. Oleh karena itu, dengan inisiatif dan motivasi yang kuat, saya merasa terdorong untuk membantu ayah saya dengan mengembangkan usaha kami melalui penjualan online.',
'produk' => 'IMG_20230531_140027_922.jpg',
'pelatihan_dispora_sebelumnya' => 'Belum',
'pelatihan_lainnya' => 'Belum',
'komunitas' => 'Tidak tergabung',
'ig_komunitas' => NULL,
'profil_komunitas' => NULL,
'tentang_diri' => 'Saya, Afinindya, berusia 19 tahun dan tinggal di Bandung. Saya memiliki pengalaman aktif di SMA 9 Bandung, di mana saya terlibat dalam kegiatan OSIS dan menjabat di bidang Komunikasi dan Informasi (Kominfo). Sekarang, saya merupakan mahasiswa aktif di ITENAS Bandung, jurusan Desain Komunikasi Visual, dan saat ini berada di tahun keempat kuliah dengan IPK 3.78. Selain itu, saya juga terlibat dalam pemeran soraya 2022 dan menjadi ketua danus di dalamnya. Saya juga aktif dalam UKM ISEF di kampus, berperan sebagai Internal Affairs. Selain itu, saya juga terlibat dalam desain grafis di Bimo Snack Store.',
'plus_minus_diri' => 'Saya memiliki kelebihan dalam mengatur time management dengan baik dan memiliki kecepatan dalam mendesain dengan baik dan jelas jika diberikan brief yang tepat. Saya juga memiliki kemampuan kepemimpinan yang terbukti dengan terpilihnya saya sebagai ketua dalam setiap event. Meskipun saya memiliki pengalaman minim  dan terlalu perfeksionis, saya memiliki kemauan yang kuat untuk belajar dan berkembang.',
'prestasi_diri' => 'Selama saya bersekolah di SMA, saya mengikuti lomba pidato dalam bahasa Inggris dan berhasil meraih posisi juara ke-3. Selain itu, saya juga meraih peringkat ke-2 UN SMA. Selama kuliah, saya berpartisipasi dalam lomba Debate Contest dan  saya berhasil meraih posisi juara pertama dalam kompetisi tersebut.',
'kegagalan' => 'Saya merasakan kegagalan dalam upaya saya untuk masuk ke perguruan tinggi negeri. Kegagalan tersebut disebabkan oleh kurangnya usaha dan dedikasi dalam belajar. Meskipun itu adalah saat yang sulit, saya mengambil pelajaran berharga dari kegagalan tersebut.',
'impian' => 'Sebagai mahasiswa jurusan Desain Komunikasi Visual (DKV), saya sangat tertarik dengan bidang branding dan UI/UX. Saya memiliki impian untuk bekerja di Pot Branding House, sebuah perusahaan branding ternama yang bertanggung jawab dalam menciptakan logo IKN tahun ini. Selain itu, saya juga memiliki keinginan kuat untuk membuat toko saya menjadi lebih stabil dan sukses.',
'wawasan_latsar' => 'Pelatihan ini diadakan oleh Dispora Bandung. Pelatihan ini dengan tujuan melatih wirausahan di Kota Bandung.',
'komitmen' => 'Bersedia',
'anak_ke_berapa' => '2',
'anak_ke_berapa_dari' => '2',
'harapan' => 'Saya sungguh berharap dapat mengaplikasikan dengan baik semua keterampilan dan pengetahuan yang akan saya peroleh dari pelatihan ini.',
'pengertian_pengusaha' => 'Wirausaha adalah individu yang menciptakan, mengelola, dan mengembangkan usaha atau bisnis dengan tujuan untuk menghasilkan keuntungan. Seorang wirausaha bertanggung jawab atas semua aspek usaha, termasuk perencanaan, pengorganisasian, pengambilan keputusan, pengelolaan sumber daya, pemasaran, dan penanganan risiko.',
'satusatunya' => 'iya',
'cocok_pengusaha' => 'Karena saya adalah  individu yang memiliki kreativitas dan inovasi untuk menghasilkan ide-ide baru, keberanian dan kemandirian untuk mengambil inisiatif',
