'domisili_alamat_lengkap' => NULL,
'domisili_rt' => 4,
'domisili_rw' => 1,
'domisili_file' => NULL,
'instagram' => NULL,
'facebook' => NULL,
'twitter' => NULL,
'alasan' => 'Saya memiliki plan berwirausaha pada bidang FnB terutama pastry dan bakery dikarenakan banyak peminat yang membeli produk tersebut. Tetapi karena keterbatasan sarana dan prasarana di rumah, saya tidak bisa explore secara maksimal. Oleh karena itu, saya tertarik untuk mengikuti Latsar yang diadakan oleh Cempor Dispora Kota Bandung.',
'usaha' => 'Sudah',
'kendalau_saha' => 'Kendala usaha saya adalah persaingan bisnis online yang semakin ketat terutama pada saingan harga, selain itu teknik marketing yang dilakukan saat sebelum Covid-19 dan setelah Covid-19 berbeda sehingga saya merasa perlu untuk mendalami dunia digital marketing agar dapat bersaing dengan penjual yang lain',
'sekilas_usaha' => 'Saya berusaha pada bidang bisnis online yang menjual fancy stationery seperti buku tulis, binder, stiker, kotak pensil, washi tape, dll. Saya berjualan melalui e-commerce shopee. Usaha ini sudah saya jalani sejak tahun 2018.',
'produk' => 'WhatsApp-Image-2023-06-07-at-22.31.11.jpeg',
'pelatihan_dispora_sebelumnya' => 'belum pernah',
'pelatihan_lainnya' => 'Pelatihan Pembuatan Roti dan Kue yang diselenggarakan oleh BPVP Bandung Barat Tahun 2023',
'komunitas' => NULL,
'ig_komunitas' => NULL,
'profil_komunitas' => NULL,
'tentang_diri' => 'Perkenalkan saya Putri Raudia Zahra, biasa dipanggil Putri. Saya merupakan freshgraduate dari Pendidikan Teknologi Agroindustri Universitas Pendidikan Indonesia. Selama berkuliah hingga sekarang, saya memiliki usaha bisnis online di e-commerce shopee. Tetapi, sekarang saya sedang belajar untuk membuka usaha pada bidang Food and Beverage.',
'plus_minus_diri' => 'Kelebihan saya adalah saya orang yang mudah berbaur, memiliki jiwa kepemimpinan, dan senang untuk belajar hal baru.
Kekurangan saya adalah saya emosional sehingga mudah untuk terasa terlalu senang, sedih, dan marah. Tetapi hal ini dapat diatasi dengan cara melakukan hal-hal yang positif sehingga dapat melupakannya.',
'prestasi_diri' => 'Prestasi yang paling saya banggakan adalah saya menjuarai peringkat 3 lomba travelling DâFaid Competition yang diadakan oleh Palang Merah Indonesia pada tahun 2017. 

Selain itu, pada tahun 2020 saya diamanahi menjadi Ketua Departemen Keuangan himpunan di jurusan kuliah saya. Alhamdulillah seluruh program kerja yang saya pimpin dapat terlaksana dengan baik dan memberikan hasil yang maksimal',
'kegagalan' => 'Kegagalan yang membuat saya menyesal adalah saya terlalu fokus ketika mengerjakan skripsi saya sehingga membuat usaha online saya tidak dapat saya kembangkan dengan baik. Padahal, masa tersebut adalah masa dimana saya dapat memanfaatkan tren-tren yang ada agar penjualan saya meningkat',
'impian' => 'Impian saya 5 tahun mendatang adalah saya sudah memiliki usaha sendiri dengan penghasilan yang mencukupi, memiliki tempat produksi sendiri, dan membuka lapangan pekerjaan baru untuk orang lain.',
'wawasan_latsar' => 'Pelatihan ini merupakan pelatihan pembuatan pastry dan bakery yang diadakan oleh Cempor Dispora Kota Bandung yang diadakan untuk pemuda pemudi kota bandung yang ingin berwirausaha. Selain itu, banyak pelatihan lain yang dapat diikuti sesuai minat dan bakat masing-masing peserta diantaranya adalah desain kemasan, barista, barbershop, videography, dan masih banyak lagi. Tidak hanya fokus pada pembuatan pastry dan bakery, peserta juga diberikan bekal pada bidang sales dan digital marketing agar dapat bersaing dengan kompetitor lainnya.',
'komitmen' => 'Bersedia',
'anak_ke_berapa' => '1',
'anak_ke_berapa_dari' => '3',
'harapan' => 'Setelah mengikuti pelatihan dasar CEMPOR 2023, saya berharap ilmu softskill dan hardskill yang saya dapatkan dapat saya manfaatkan dengan baik. Selain itu, saya berharap saya merasa lebih siap dalam merencakan usaha saya pada bidang Food and Beverage.',
